$.aWL=A.a(["1 \u2013 \u0623\u062d\u0628 \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0645\u0642\u0627\u0644\u0627\u062a \u0627\u0644\u0645\u062a\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u0645\u064a\u0643\u0627\u0646\u064a\u0643\u0627.","2 \u2013 \u0634\u0647\u064a\u062a\u064a \u0644\u0644\u0637\u0639\u0627\u0645 \u062c\u064a\u062f\u0629 .","3 \u2013 \u0623\u0633\u062a\u064a\u0642\u0638 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u064a\u0627\u0645 \u0646\u0634\u0637\u0627\u064b \u0648\u0645\u0631\u062a\u0627\u062d\u0627\u064b.","4 \u2013 \u0623\u0641\u0636\u0644 \u0623\u0646 \u0623\u0639\u0645\u0644 \u0643\u0623\u0645\u064a\u0646 \u0645\u0643\u062a\u0628\u0629 .","5 \u2013 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0623\u0646 \u062a\u0648\u0642\u0638\u0646\u064a \u0627\u0644\u0623\u0635\u0648\u0627\u062a \u0645\u0646 \u0646\u0648\u0645\u064a . ","6 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0642\u0631\u0623 \u0627\u0644\u0645\u0642\u0627\u0644\u0627\u062a \u0627\u0644\u0645\u062a\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u062c\u0631\u0627\u0626\u0645.","7 \u2013 \u064a\u062f\u0627\u064a \u0648\u0642\u062f\u0645\u0627\u064a \u062f\u0627\u0641\u0626\u0629 \u0641\u064a \u0627\u0644\u0639\u0627\u062f\u0629 .","8 \u2013 \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0645\u0644\u064a\u0626\u0629 \u0628\u0645\u0627 \u064a\u062b\u064a\u0631 \u0627\u0647\u062a\u0645\u0627\u0645\u064a.","9 \u2013 \u0642\u062f\u0631\u062a\u064a \u0639\u0644\u0649 \u0627\u0644\u0639\u0645\u0644 \u0647\u064a \u0647\u064a \u0644\u0645 \u062a\u062a\u063a\u064a\u0631 \u0639\u0645\u0627 \u0643\u0627\u0646\u062a \u0639\u0644\u064a\u0647 \u0645\u0646 \u0642\u0628\u0644 .","10 \u2013 \u0623\u0634\u0639\u0631 \u0643\u0623\u0646 \u0634\u064a\u0626\u0627\u064b \u064a\u0642\u0641 \u0641\u064a \u062d\u0644\u0642\u064a ( \u0623\u0634\u0639\u0631 \u0628\u063a\u0635\u0647 ) \u0645\u0639\u0638\u0645 \u0627\u0644\u0648\u0642\u062a.","11 \u2013 \u064a\u062c\u0628 \u0623\u0646 \u064a\u062d\u0627\u0648\u0644 \u0627\u0644\u0634\u062e\u0635 \u0623\u0646 \u064a\u0641\u0647\u0645 \u0623\u062d\u0644\u0627\u0645\u0647 \u0648\u0623\u0646 \u064a\u062a\u062e\u0630 \u0645\u0646\u0647\u0627 \u062f\u0644\u064a\u0644\u0627\u064b \u064a\u0631\u0634\u062f\u0647 \u0623\u0648 \u0646\u0630\u064a\u0631\u0627\u064b \u064a\u062d\u0630\u0631\u0647.","12 \u2013 \u0623\u0633\u062a\u0645\u062a\u0639 \u0628\u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0631\u0648\u0627\u064a\u0627\u062a \u0627\u0644\u0628\u0648\u0644\u064a\u0633\u064a\u0629.","13 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u0624\u062f\u064a \u0639\u0645\u0644\u064a \u0623\u0643\u0648\u0646 \u0641\u064a \u062d\u0627\u0644\u0629 \u062a\u0648\u062a\u0631 \u0634\u062f\u064a\u062f .","14 \u2013 \u0623\u0635\u0627\u0628 \u0628\u0627\u0644\u0623\u0633\u0647\u0627\u0644 \u0645\u0631\u0629 \u0641\u064a \u0627\u0644\u0634\u0647\u0631 \u0623\u0648 \u0623\u0643\u062b\u0631.","15 \u2013 \u0623\u0641\u0643\u0631 \u0645\u0646 \u062d\u064a\u0646 \u0644\u0627\u062e\u0631 \u0641\u064a \u0623\u0634\u064a\u0627\u0621 \u0647\u064a \u0645\u0646 \u0627\u0644\u0642\u0628\u062d \u0628\u062d\u064a\u062b \u0644\u0627 \u064a\u0645\u0643\u0646 \u0627\u0644\u062a\u062d\u062f\u062b \u0639\u0646\u0647\u0627.","16 \u2013 \u0644\u0627\u0634\u0643 \u0641\u064a \u0623\u0646\u0646\u064a \u0645\u0638\u0644\u0648\u0645 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u064a\u0627\u0629 .","17 \u2013 \u0648\u0627\u0644\u062f\u064a \u0631\u062c\u0644 \u0637\u064a\u0628 .","18 \u2013 \u0642\u0644\u064a\u0644\u0627\u064b \u0645\u0627 \u0623\u0635\u0627\u0628 \u0628\u0627\u0644\u0627\u0645\u0633\u0627\u0643.","19 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0627\u062a\u0633\u0644\u0645 \u0639\u0645\u0644\u0627\u064b \u062c\u062f\u064a\u062f\u0627\u064b \u0623\u062d\u0628 \u0623\u0646 \u0623\u0639\u0631\u0641 \u0645\u0646 \u0647\u0648 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u0623\u0644\u064a\u0647 \u0641\u064a \u0627\u0644\u0645\u0631\u0643\u0632 .","20 \u2013 \u0627\u0646\u0646\u064a \u0642\u0627\u0646\u0639 \u0628\u062d\u064a\u0627\u062a\u064a \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u0643\u0645\u0627 \u0647\u064a \u0627\u0644\u0627\u0646 .","21 \u2013 \u062a\u0639\u0627\u0648\u062f\u0646\u064a \u0631\u063a\u0628\u0629 \u0634\u062f\u064a\u062f\u0629 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0641\u064a \u0623\u0646 \u0623\u062a\u0631\u0643 \u0623\u0633\u0631\u062a\u064a \u0648\u0623\u0628\u062a\u0639\u062f \u0639\u0646\u0647\u0627.","22 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u062d\u064a\u0627\u0646\u0627\u064b \u0646\u0648\u0628\u0627\u062a \u0645\u0646 \u0627\u0644\u0636\u062d\u0643 \u0648\u0627\u0644\u0628\u0643\u0627\u0621 \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0645\u0642\u0627\u0648\u0645\u062a\u0647\u0627 .","23 \u2013 \u0623\u0635\u0627\u0628 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0646\u0648\u0628\u0627\u062a \u0645\u0646 \u0627\u0644\u063a\u062b\u064a\u0627\u0646 \u0648\u0627\u0644\u0642\u0626 . ","24- \u064a\u0628\u062f\u0648 \u0623\u0646\u0647 \u0644\u0627 \u064a\u0648\u062c\u062f \u0645\u0646 \u064a\u0641\u0647\u0645\u0646\u0649 .","25- \u0623\u0648\u062f \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u063a\u0646\u064a\u0627\u064b .","26- \u0623\u0634\u0639\u0631 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0641\u064a \u0645\u0623\u0632\u0642 \u2013 \u0623\u0646 \u0645\u0646 \u0627\u0644\u0627\u0641\u0636\u0644 \u0644\u064a \u0623\u0644\u0627 \u0627\u062a\u0643\u0644\u0645 .","27- \u062a\u0633\u064a\u0637\u0631 \u0639\u0644\u064a \u0631\u0648\u062d \u0627\u0644\u0634\u0631 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 .","28- \u0639\u0646\u062f\u0645\u0627 \u064a\u0633\u0626 \u0625\u0644\u064a \u0627\u062d\u062f \u0623\u0634\u0639\u0631 \u0628\u0623\u0646 \u0645\u0646 \u0627\u0644\u0648\u0627\u062c\u0628 \u0623\u0646 \u0623\u0631\u062f \u0627\u0644\u0625\u0633\u0627\u0621\u0629 \u0628\u0627\u0644\u0625\u0633\u0627\u0621\u0629 .","29- \u0623\u0635\u0627\u0628 \u0628\u0645\u062d\u0648\u0636\u0629 \u0627\u0644\u0645\u0639\u062f\u0629 \u0628\u0634\u0643\u0644 \u064a\u0636\u0627\u064a\u0642\u0646\u0649 \u0639\u062f\u0629 \u0627\u064a\u0627\u0645 \u0641\u064a \u0627\u0644\u0623\u0633\u0628\u0648\u0639 .","30- \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u0633\u0628 .","31 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u0623\u062d\u0644\u0627\u0645 \u0627\u0644\u0645\u0632\u0639\u062c\u0629 \u0645\u0631\u0629 \u0643\u0644 \u0639\u062f\u0629 \u0644\u064a\u0627\u0644.","32 \u2013 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0623\u0646 \u0627\u0631\u0643\u0632 \u0630\u0647\u0646\u064a \u0641\u064a \u0639\u0645\u0644 \u0627\u0648 \u0645\u0647\u0645\u0629 .","33 \u2013 \u0645\u0631\u0631\u062a \u0628\u062e\u0628\u0631\u0627\u062a \u0641\u064a \u0645\u0646\u062a\u0647\u0649 \u0627\u0644\u0639\u062c\u0628 \u0648\u0627\u0644\u063a\u0631\u0627\u0628\u0629 .","34 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u0643\u062d\u0629 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0648\u0642\u062a .","35 \u2013 \u0644\u0648 \u0644\u0645 \u064a\u0636\u0645\u0631 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644\u0639\u062f\u0627\u0648\u0629 \u0644\u064a \u0644\u0643\u0646\u062a \u0623\u0643\u062b\u0631 \u0646\u062c\u0627\u062d\u0627\u064b \u0628\u0643\u062b\u064a\u0631 \u0645\u0645\u0627 \u0623\u0646\u0627 \u0639\u0644\u064a\u0647 .","36 \u2013 \u0642\u0644\u064a\u0644\u0627\u064b \u0645\u0627 \u064a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u0642\u0644\u0642 \u0639\u0644\u0649 \u0635\u062d\u062a\u064a.","37 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u0642\u0637 \u0623\u064a \u0625\u0634\u0643\u0627\u0644 \u0628\u0633\u0628\u0628 \u0633\u0644\u0648\u0643\u064a \u0627\u0644\u062c\u0646\u0633\u064a.","38 \u2013 \u0623\u0631\u062a\u0628\u0643\u062a \u0628\u0639\u0636 \u0627\u0644\u0633\u0631\u0642\u0627\u062a \u0627\u0644\u0628\u0633\u064a\u0637\u0629 \u0641\u064a \u0641\u062a\u0631\u0629 \u0645\u0627 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0635\u063a\u064a\u0631\u0627\u064b \u0641\u064a \u0627\u0644\u0633\u0646.","39 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u062a\u062d\u0637\u064a\u0645 \u0627\u0644\u0623\u0634\u064a\u0627\u0621.","40 \u2013 \u0623\u0641\u0636\u0644 \u0641\u064a \u062c\u0645\u064a\u0639 \u0627\u0644\u0623\u0648\u0642\u0627\u062a \u0623\u0646 \u0623\u062c\u0644\u0633 \u0648\u0623\u0633\u062a\u0631\u0633\u0644 \u0641\u064a \u0623\u062d\u0644\u0627\u0645 \u0627\u0644\u064a\u0642\u0638\u0629 \u0639\u0644\u0649 \u0623\u0646 \u0623\u0642\u0648\u0645 \u0628\u0623\u064a \u0639\u0645\u0644 \u0622\u062e\u0631.","41 \u2013 \u0645\u0631\u062a \u0628\u064a \u0641\u062a\u0631\u0627\u062a \u062a\u0642\u062f\u0631 \u0628\u0627\u0644\u0623\u064a\u0627\u0645 \u0648\u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0627\u0644\u0623\u0633\u0627\u0628\u064a\u0639 \u0623\u0648 \u0627\u0644\u0623\u0634\u0647\u0631 \u0641\u0642\u062f\u062a \u0641\u064a\u0647\u0627 \u0627\u0644\u0642\u062f\u0631\u0629 \u0639\u0644\u0649 \u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645 \u0628\u0645\u0627 \u062d\u0648\u0644\u064a \u0648\u0630\u0644\u0643 \u0644\u0623\u0646\u0646\u064a \u0644\u0645 \u0623\u0633\u062a\u0637\u0639 \u0645\u0648\u0627\u0635\u0644\u0629 \u0646\u0634\u0627\u0637\u064a. ","42 \u2013 \u0623\u0633\u0631\u062a\u064a \u0644\u0627 \u062a\u0645\u064a\u0644 \u0627\u0644\u0649 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0630\u064a \u0627\u062e\u062a\u0631\u062a\u0647 ( \u0623\u0648 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0630\u064a \u0623\u0646\u0648\u064a \u0627\u062a\u062e\u0627\u0630\u0647 \u0645\u0647\u0646\u0629 \u0644\u064a \u0637\u0648\u0644 \u062d\u064a\u0627\u062a\u064a )","43 \u2013 \u0646\u0648\u0645\u064a \u0645\u0636\u0637\u0631\u0628 \u0648\u0642\u0644\u0642 .","44 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0648\u0642\u0627\u062a \u0628\u0627\u0644\u0622\u0645 \u0641\u064a \u062c\u0645\u064a\u0639 \u0623\u062c\u0632\u0627\u0621 \u0631\u0623\u0633\u064a.","45 \u2013 \u0644\u0627 \u0623\u0642\u0648\u0644 \u0627\u0644\u0635\u062f\u0642 \u062f\u0627\u0626\u0645\u0627\u064b .","46 \u2013 \u062d\u0643\u0645\u064a \u0639\u0644\u0649 \u0627\u0644\u0627\u0645\u0648\u0631 \u0627\u0644\u0622\u0646 \u0623\u0641\u0636\u0644 \u0645\u0646\u0647 \u0641\u064a \u0623\u064a \u0648\u0642\u062a \u0645\u0636\u0649 .","47 \u2013 \u0623\u0634\u0639\u0631 \u0643\u0644 \u0623\u0633\u0628\u0648\u0639 \u2013 \u0623\u0648 \u0623\u0642\u0644 \u2013 \u0628\u0633\u062e\u0648\u0646\u0629 \u062a\u0639\u0645 \u062c\u0633\u0645\u064a \u0641\u062c\u0623\u0629 \u0648\u0630\u0644\u0643 \u062f\u0648\u0646 \u0645\u0627 \u0633\u0628\u0628 \u0638\u0627\u0647\u0631.","48 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0645\u0639 \u0627\u0644\u0646\u0627\u0633 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u0646 \u0623\u0633\u0645\u0639 \u0623\u0634\u064a\u0627\u0621 \u062c\u062f \u063a\u0631\u064a\u0628\u0629 .","49 \u2013 \u062d\u0628\u0630\u0627 \u0644\u0648 \u062a\u0644\u063a\u0649 \u0645\u0639\u0638\u0645 \u0627\u0644\u0642\u0648\u0627\u0646\u064a\u0646 .","50 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0628\u0623\u0646 \u0631\u0648\u062d\u064a \u062a\u0641\u0627\u0631\u0642 \u062c\u0633\u062f\u064a.","51 \u2013 \u0635\u062d\u062a\u064a \u0627\u0644\u062c\u0633\u064a\u0645\u0629 \u0643\u0635\u062d\u0629 \u0645\u0639\u0638\u0645 \u0623\u0635\u062f\u0627\u0642\u064a \u0641\u064a \u0627\u0644\u062c\u0648\u062f\u0629 .","52 \u2013 \u0623\u0641\u0636\u0644 \u0623\u0646 \u0623\u062a\u062c\u0627\u0647\u0644 \u0623\u0635\u062f\u0642\u0627\u0621 \u0627\u0644\u0645\u062f\u0631\u0633\u0629 \u0623\u0648 \u0627\u0644\u0645\u0639\u0627\u0631\u0641 \u0627\u0644\u0630\u064a\u0646 \u0644\u0645 \u0623\u0631\u0647\u0645 \u0645\u0646\u0630 \u0645\u062f\u0629 \u0637\u0648\u064a\u0644\u0629 \u060c \u0625\u0644\u0627 \u0625\u0630\u0627 \u0628\u0627\u062f\u0631\u0648\u0646\u064a \u0647\u0645 \u0628\u0627\u0644\u0643\u0644\u0627\u0645 .","53 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0631\u062c\u0644 \u0627\u0644\u062f\u064a\u0646 \u064a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u064a\u0634\u0641\u0649 \u0627\u0644\u0623\u0645\u0631\u0627\u0636 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0635\u0644\u0627\u0629 \u060c \u0648\u0648\u0636\u0639 \u064a\u062f\u0647 \u0639\u0644\u0649 \u0631\u0623\u0633 \u0627\u0644\u0645\u0631\u064a\u0636.","54 \u2013 \u0625\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0630\u064a\u0646 \u064a\u0639\u0631\u0641\u0648\u0646\u0646\u064a \u064a\u062d\u0628\u0648\u0646\u0646\u064a .","55 \u2013 \u0644\u0627 \u062a\u0643\u0627\u062f \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0623\u064a\u0629 \u0622\u0644\u0627\u0645 \u0641\u064a \u0627\u0644\u0642\u0644\u0628 \u0623\u0648 \u0641\u064a \u0627\u0644\u0635\u062f\u0631.","56 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0635\u063a\u064a\u0631\u0627\u064b \u060c \u0641\u0635\u0644\u062a \u0645\u0646 \u0627\u0644\u0645\u062f\u0631\u0633\u0629 \u0645\u0631\u0629 \u0623\u0648 \u0623\u0643\u062b\u0631 \u0628\u0633\u0628\u0628 \u062a\u0645\u0631\u062f\u064a \u0648\u0639\u0635\u064a\u0627\u0646\u064a.","57 \u2013 \u0627\u0646\u0646\u064a \u0633\u0647\u0644 \u0627\u0644\u0627\u062e\u062a\u0644\u0627\u0637 \u0628\u0627\u0644\u0646\u0627\u0633 .","58 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0643\u0644 \u0634\u0626 \u064a\u062d\u062f\u062b \u0648\u0641\u0642\u0627\u064b \u0644\u0645\u0627 \u0630\u0643\u0631\u0647 \u0627\u0644\u0623\u0646\u0628\u064a\u0627\u0621 \u0648\u0627\u0644\u0631\u0633\u0644 .","59 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0627\u0636\u0637\u0631\u0631\u062a \u0625\u0644\u0649 \u0623\u0646 \u0623\u062a\u0644\u0642\u0649 \u0623\u0648\u0627\u0645\u0631 \u0645\u0645\u0646 \u0647\u0648 \u0623\u0642\u0644 \u0645\u0646\u064a \u0645\u0639\u0631\u0641\u0629.","60 \u2013 \u0644\u0627 \u0623\u0642\u0631\u0623 \u0643\u0644 \u0645\u0642\u0627\u0644 \u0627\u0641\u062a\u062a\u0627\u062d\u064a \u0641\u064a \u0627\u0644\u062c\u0631\u064a\u062f\u0629 \u0627\u0644\u064a\u0648\u0645\u064a\u0629 .","61 \u2013 \u0644\u0645 \u0623\u0639\u0634 \u0627\u0644\u062d\u064a\u0627\u0629 \u0627\u0644\u0635\u062d\u064a\u062d\u0629 \u0627\u0644\u062a\u064a \u0643\u0627\u0646 \u064a\u062c\u0628 \u0623\u0646 \u0623\u0639\u064a\u0634\u0647\u0627.","62 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u0634\u0639\u0631 \u0641\u064a \u0628\u0639\u0636 \u0623\u062c\u0632\u0627\u0621 \u062c\u0633\u0645\u064a \u0628\u0645\u0627 \u064a\u0634\u0628\u0647 \u0627\u0644\u0625\u062d\u062a\u0631\u0627\u0642 \u0623\u0648 \u0627\u0644\u0642\u0634\u0639\u0631\u064a\u0631\u0629 \u0623\u0648 \u0627\u0644\u062a\u0646\u0645\u064a\u0644 \u0623\u0648 \u0627\u0644\u062a\u062e\u062f\u064a\u0631 .","63 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u0648\u062c\u062f\u062a \u0623\u064a\u0629 \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0636\u0628\u0637 \u0639\u0645\u0644\u064a\u0629 \u0627\u0644\u062a\u0628\u0631\u0632.","64 \u2013 \u0623\u062b\u0627\u0628\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0639\u0644\u0649 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0639\u0645\u0644 \u0645\u0627 \u0625\u0644\u0649 \u0623\u0646 \u064a\u0641\u0642\u062f \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u0635\u0628\u0631\u0647\u0645 \u0645\u0639\u064a.","65 \u2013 \u0623\u062d\u0628 \u0648\u0627\u0644\u062f\u064a.","66 \u2013 \u0623\u0631\u0649 \u062d\u0648\u0644\u064a \u0623\u0634\u064a\u0627\u0621 \u0648\u062d\u064a\u0648\u0627\u0646\u0627\u062a \u0648\u0646\u0627\u0633 \u0644\u0627 \u064a\u0631\u0627\u0647\u0645 \u063a\u064a\u0631\u064a.","67 \u2013 \u0623\u062a\u0645\u0646\u0649 \u0644\u0648 \u0643\u0646\u062a \u0633\u0639\u064a\u062f\u0627\u064b \u0643\u0645\u0627 \u064a\u0628\u062f\u0648 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 ","68 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0623\u0646 \u0634\u0639\u0631\u062a \u0628\u0623\u0644\u0645 \u0641\u064a \u062e\u0644\u0641 \u0627\u0644\u0639\u0646\u0642 .","69 \u2013 \u0623\u0641\u0636\u0644 \u062f\u0627\u0626\u0645\u0627\u064b \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u0639 \u0623\u0641\u0631\u0627\u062f \u0641\u064a \u0646\u0641\u0633 \u062c\u0646\u0633\u064a.","70 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u062c\u062a\u0630\u0628 \u0623\u0641\u0631\u0627\u062f \u0627\u0644\u062c\u0646\u0633 \u0627\u0644\u0622\u062e\u0631.","71 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u064a\u0628\u0627\u0644\u063a\u0648\u0646 \u0641\u064a \u062a\u0635\u0648\u064a\u0631 \u0633\u0648\u0621 \u062d\u0638\u0647\u0645 \u0643\u064a \u064a\u0646\u0627\u0644\u0648\u0627 \u0639\u0637\u0641 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u0648\u0645\u0633\u0627\u0639\u062f\u062a\u0647\u0645.","72 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0622\u0644\u0627\u0645 \u0641\u064a \u0627\u0644\u0645\u0639\u062f\u0629 \u0643\u0644 \u0628\u0636\u0639\u0629 \u0623\u064a\u0627\u0645 \u0642\u0644\u0627\u0626\u0644 .","73 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0646\u064a \u0634\u062e\u0635 \u0645\u0647\u0645.","74 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0648\u062f\u062f\u062a \u0623\u0646 \u0623\u0643\u0648\u0646 \u0628\u0646\u062a\u0627\u064b ( \u0648\u0625\u0630\u0627 \u0643\u0627\u0646 \u0627\u0644\u0645\u062c\u064a\u0628 \u0623\u0646\u062b\u0649 : \u0644\u0645 \u0622\u0633\u0641 \u0623\u0628\u062f\u0627\u064b \u0639\u0644\u0649 \u0623\u0646\u0646\u064a \u062e\u0644\u0642\u062a \u0628\u0646\u062a\u0627\u064b ).","75 \u2013 \u0628\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u063a\u0636\u0628 \u0623\u062d\u064a\u0627\u0646\u0627\u064b .","76 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u062d\u0632\u0646 \u0648\u0627\u0644\u0625\u0646\u0642\u0628\u0627\u0636 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0648\u0642\u0627\u062a.","77 \u2013 \u0623\u062d\u0628 \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u0642\u0635\u0635 \u0627\u0644\u063a\u0631\u0627\u0645\u064a\u0629.","78 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0634\u0639\u0631.","79 \u2013 \u0644\u064a\u0633 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0623\u0646 \u064a\u062c\u0631\u062d \u0623\u062d\u062f \u0634\u0639\u0648\u0631\u064a .","80 \u2013 \u0623\u0639\u0627\u0643\u0633 \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u0627\u062a \u0623\u062d\u064a\u0627\u0646\u0627.","81 \u2013 \u0623\u0645\u064a\u0644 \u0625\u0644\u0649 \u0627\u0644\u0623\u0639\u0645\u0627\u0644 \u0627\u0644\u062e\u0634\u0646\u0629 \u0643\u0627\u0644\u0639\u0645\u0644 \u0641\u064a \u0627\u0644\u062d\u0642\u0648\u0644 \u0648\u0627\u0644\u063a\u0627\u0628\u0627\u062a.","82 \u2013 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0623\u0646 \u0623\u0647\u0632\u0645 \u0641\u064a \u0627\u0644\u0645\u0646\u0627\u0642\u0634\u0629 .","83 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0647\u0646\u0627\u0643 \u0641\u0631\u0635\u0629 \u0643\u0628\u064a\u0631\u0629 \u0644\u0644\u0646\u062c\u0627\u062d \u0623\u0645\u0627\u0645 \u0643\u0644 \u0634\u062e\u0635 \u064a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u064a\u0639\u0645\u0644 \u0628\u062c\u062f \u0648\u064a\u0631\u063a\u0628 \u0641\u064a \u0630\u0644\u0643.","84 \u2013 \u0623\u062c\u062f \u0645\u0646 \u0627\u0644\u0635\u0639\u0628 \u0639\u0644\u064a \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u0623\u064a\u0627\u0645 \u0623\u0646 \u0623\u0638\u0644 \u0645\u062d\u062a\u0641\u0638\u0627\u064b \u0628\u0623\u0645\u0644\u064a \u0641\u064a \u0623\u0646\u0646\u064a \u0633\u0623\u0631\u062a\u0642\u064a.","85 \u2013 \u0623\u0639\u062c\u0628 \u0625\u0639\u062c\u0627\u0628\u0627\u064b \u0634\u062f\u064a\u062f\u0629 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0628\u0627\u0644\u0645\u0645\u062a\u0644\u0643\u0627\u062a \u0627\u0644\u0634\u062e\u0635\u064a\u0629 \u0644\u0644\u0622\u062e\u0631\u064a\u0646 \u0643\u0627\u0644\u0623\u062d\u0630\u064a\u0629 \u0648\u0627\u0644\u0642\u0641\u0627\u0632\u0627\u062a \u0627\u0644\u062e .. \u0644\u062f\u0631\u062c\u0629 \u0627\u0646\u0646\u064a \u0623\u0631\u063a\u0628 \u0641\u064a \u0627\u0644\u0639\u0628\u062b \u0628\u0647\u0627 \u0623\u0648 \u0633\u0631\u0642\u062a\u0647\u0627 \u0628\u0627\u0644\u0631\u063a\u0645 \u0645\u0646 \u0623\u0646\u0647\u0627 \u0644\u0627 \u062a\u0635\u0644\u062d \u0644\u064a .","86 \u2013 \u0645\u0646 \u0627\u0644\u0645\u0624\u0643\u062f \u0623\u0646\u0646\u064a \u0642\u0644\u064a\u0644 \u0627\u0644\u062b\u0642\u0629 \u0628\u0646\u0641\u0633\u064a .","87 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0628\u0627\u0626\u0639 \u0632\u0647\u0648\u0631.","88 \u2013 \u0623\u0634\u0639\u0631 \u0639\u0644\u0649 \u0648\u062c\u0647 \u0627\u0644\u0639\u0645\u0648\u0645 \u0623\u0646 \u0627\u0644\u062d\u064a\u0627\u0629 \u0644\u0647\u0627 \u0642\u064a\u0645\u0629 .","89 \u2013 \u0625\u0642\u0646\u0627\u0639 \u0627\u0644\u0646\u0627\u0633 \u0628\u0627\u0644\u0635\u0648\u0627\u0628 \u064a\u062a\u0637\u0644\u0628 \u0645\u062c\u0647\u0648\u062f\u0627\u064b \u0643\u0628\u064a\u0631\u0627\u064b .","90 \u2013 \u0623\u0624\u062c\u0644 \u0627\u0644\u0649 \u0627\u0644\u063a\u062f \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0645\u0627 \u064a\u062c\u0628 \u0623\u0646 \u0623\u0639\u0645\u0644\u0647 \u0627\u0644\u064a\u0648\u0645 .","91 \u2013 \u0644\u0627 \u064a\u0636\u064a\u0631\u0646\u064a \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u0648\u0636\u0648\u0639 \u0645\u0632\u0627\u062d.","92 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0634\u062a\u063a\u0644 \u0628\u0627\u0644\u062a\u0645\u0631\u064a\u0636.","93 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u0645\u0633\u062a\u0639\u062f\u0648\u0646 \u0644\u0623\u0646 \u064a\u0643\u0630\u0628\u0648\u0627 \u0641\u064a \u0633\u0628\u064a\u0644 \u0627\u0644\u062a\u0641\u0648\u0642 \u0639\u0644\u0649 \u063a\u064a\u0631\u0647\u0645.","94 \u2013 \u0623\u0639\u0645\u0644 \u0623\u0634\u064a\u0627\u0621 \u0643\u062b\u064a\u0631\u0629 \u0623\u0646\u062f\u0645 \u0639\u0644\u064a\u0647\u0627 \u0641\u064a\u0645\u0627 \u0628\u0639\u062f .","95 \u2013 \u0623\u062a\u0631\u062f\u062f \u0639\u0644\u0649 \u0623\u0645\u0627\u0643\u0646 \u0627\u0644\u0639\u0628\u0627\u062f\u0629 \u0643\u0644 \u0623\u0633\u0628\u0648\u0639 \u062a\u0642\u0631\u064a\u0628\u0627\u064b .","96 \u2013 \u0645\u0634\u0627\u062c\u0631\u0627\u062a\u064a \u0642\u0644\u064a\u0644\u0629 \u062c\u062f\u0627\u064b \u0645\u0639 \u0623\u0641\u0631\u0627\u062f \u0639\u0627\u0626\u0644\u062a\u064a .","97 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0631\u063a\u0628\u0629 \u062c\u0627\u0645\u062d\u0629 \u0641\u064a \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0639\u0645\u0644 \u064a\u0636\u0631 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u0623\u0648 \u064a\u0635\u062f\u0645\u0647\u0645 .","98 \u2013 \u0623\u0639\u062a\u0642\u062f \u0641\u064a \u0645\u062c\u0626 \u0627\u0644\u0645\u0647\u062f\u064a \u0627\u0644\u0645\u0646\u062a\u0638\u0631 \u0623\u0648 \u0641\u064a \u0639\u0648\u062f\u0629 \u0627\u0644\u0645\u0633\u064a\u062d.","99 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0630\u0647\u0628 \u0627\u0644\u0649 \u0627\u0644\u062d\u0641\u0644\u0627\u062a \u0623\u0648 \u0627\u0644\u0625\u062c\u062a\u0645\u0627\u0639\u0627\u062a \u0627\u0644\u0623\u062e\u0631\u0649 \u0627\u0644\u062a\u064a \u0623\u062c\u062f \u0641\u064a\u0647\u0627 \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0644\u0647\u0648 \u0648\u0627\u0644\u0635\u062e\u0628.","100 \u2013 \u0642\u0627\u0628\u0644\u062a \u0645\u0634\u0643\u0644\u0627\u062a \u0644\u0645 \u0623\u0633\u062a\u0637\u0639 \u0623\u0646 \u0623\u0642\u0631\u0631 \u0634\u064a\u0626\u0623\u064b \u0628\u0634\u0623\u0646\u0647\u0627 \u0644\u0643\u062b\u0631\u0629 \u0645\u0627 \u0643\u0627\u0646 \u0644\u0647\u0627 \u0645\u0646 \u062d\u0644\u0648\u0644 .","101 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0647 \u064a\u062c\u0628 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0644\u0644\u0645\u0631\u0623\u0629 \u0645\u0646 \u0627\u0644\u062d\u0631\u064a\u0629 \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u0645\u062b\u0644 \u0645\u0627 \u0644\u0644\u0631\u062c\u0644 .","102 \u2013 \u0623\u0634\u062f \u0627\u0644\u0645\u0639\u0627\u0631\u0643 \u0639\u0646\u062f\u064a \u0647\u064a \u0627\u0644\u0645\u0639\u0631\u0643\u0629 \u0628\u064a\u0646\u064a \u0648\u0628\u064a\u0646 \u0646\u0641\u0633\u064a.","103 \u2013 \u0644\u0627 \u0623\u0634\u0643\u0648 \u062a\u0642\u0644\u0635\u0627\u064b \u0641\u064a \u0627\u0644\u0639\u0636\u0644\u0627\u062a \u0648\u0625\u0646 \u0641\u0639\u0644\u062a \u0641\u0646\u0627\u062f\u0631\u0627\u064b .","104 \u2013 \u064a\u0628\u062f\u0648 \u0627\u0646\u0646\u064a \u0644\u0627 \u0623\u0647\u062a\u0645 \u0628\u0645\u0627 \u064a\u062d\u062f\u062b \u0644\u064a .","105 \u2013 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u062a\u0633\u0648\u0621 \u0635\u062d\u062a\u064a.","106 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0623\u0646\u0646\u064a \u0642\u062f \u0627\u0631\u062a\u0643\u0628\u062a \u062e\u0637\u0623 \u0623\u0648 \u0623\u062a\u064a\u062a \u0634\u0631\u0627\u064b .","107 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u0633\u0639\u0627\u062f\u0629 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0648\u0642\u0627\u062a .","108 \u2013 \u0623\u0634\u0639\u0631 \u0645\u0639\u0638\u0645 \u0627\u0644\u0648\u0642\u062a \u0628\u0623\u0646 \u0631\u0623\u0633\u064a \u0639\u0644\u0649 \u0648\u0634\u0643 \u0627\u0644\u0625\u0646\u0641\u062c\u0627\u0631.","109 \u2013 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u064a\u0635\u0644 \u062d\u0628\u0647\u0645 \u0644\u0644\u0633\u064a\u0637\u0631\u0629 \u0627\u0644\u0649 \u062f\u0631\u062c\u0629 \u0623\u0634\u0639\u0631 \u0645\u0639\u0647\u0627 \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0645\u062e\u0627\u0644\u0641\u062a\u0647\u0645 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0627\u0646 \u0639\u0644\u0649 \u062d\u0642 .","110 \u2013 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u064a\u0636\u0645\u0631 \u0644\u064a \u0641\u064a \u0646\u0633\u0641\u0647 \u0634\u064a\u0626\u0627\u064b","111 - \u0644\u0645 \u0623\u0642\u0645 \u0642\u0637 \u0628\u0639\u0645\u0644 \u0641\u064a\u0647 \u062e\u0637\u0631 \u0644\u0645\u062c\u0631\u062f \u0627\u0644\u0625\u062b\u0627\u0631\u0629 \u0627\u0644\u062a\u064a \u062a\u062a\u0631\u062a\u0628 \u0639\u0644\u0649 \u0630\u0644\u0643.","112 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u062c\u062f \u0645\u0646 \u0627\u0644\u0636\u0631\u0648\u0631\u064a \u0623\u0646 \u0623\u062f\u0627\u0641\u0639 \u0639\u0645\u0627 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0647 \u0635\u0648\u0627\u0628.","113 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0647 \u0645\u0646 \u0627\u0644\u0648\u0627\u062c\u0628 \u0623\u0646 \u062a\u0641\u0631\u0636 \u0627\u0644\u0642\u0648\u0627\u0646\u064a\u0646 \u0639\u0644\u0649 \u0627\u0644\u0646\u0627\u0633 \u0641\u0631\u0636\u0627\u064b .","114 \u2013 \u0623\u0634\u0639\u0631 \u063a\u0627\u0644\u0628\u0627\u064b \u0628\u0636\u063a\u0637 \u0634\u062f\u064a\u062f \u062d\u0648\u0644 \u0631\u0623\u0633\u064a .","115 \u2013 \u0623\u0639\u062a\u0642\u062f \u0641\u064a \u0627\u0644\u062d\u064a\u0627\u0629 \u0627\u0644\u0627\u062e\u0631\u0629 .","116 \u2013 \u064a\u0632\u062f\u0627\u062f \u0644\u0625\u0633\u062a\u0645\u062a\u0627\u0639\u064a \u0628\u0627\u0644\u0645\u0633\u0627\u0628\u0642\u0627\u062a \u0623\u0648 \u0627\u0644\u0645\u0628\u0627\u0631\u064a\u0627\u062a \u0639\u0646\u062f\u0645\u0627 \u0623\u0631\u0627\u0647\u0646 \u0639\u0644\u064a\u0647\u0627.","117 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0627\u0644\u0646\u0627\u0633 \u0623\u0645\u0646\u0627\u0621 \u0644\u062e\u0648\u0641\u0647\u0645 \u0623\u0646 \u064a\u0643\u062a\u0634\u0641 \u0623\u0645\u0631\u0647\u0645. ","118 \u2013 \u0643\u0646\u062a \u0623\u062d\u0648\u0644 \u0625\u0644\u0649 \u0627\u0644\u0646\u0627\u0638\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0633\u0628\u0628 \u062a\u063a\u064a\u0628\u064a \u0639\u0646 \u0627\u0644\u0645\u062f\u0631\u0633\u0629.","119 - \u0644\u0645 \u064a\u062a\u063a\u064a\u0631 \u0635\u0648\u062a\u064a \u0639\u0645\u0644 \u0643\u0627\u0646 \u0639\u0644\u064a\u0647 \u0641\u0644\u0645 \u064a\u0639\u062f \u0623\u0633\u0631\u0639 \u0623\u0648 \u0623\u0628\u0637\u0623 \u0623\u0648 \u0623\u0643\u062b\u0631 \u062d\u0634\u0631\u062c\u0629 \u0623\u0648 \u0623\u062d\u0633\u0646 \u0645\u0646 \u0630\u064a \u0642\u0628\u0644 .","120 \u2013 \u0644\u0627 \u0623\u0647\u062a\u0645 \u0628\u0645\u0631\u0627\u0639\u0627\u0629 \u0622\u062f\u0627\u0628 \u0627\u0644\u0645\u0627\u0626\u062f\u0629 \u0641\u064a \u0645\u0646\u0632\u0644\u064a \u0643\u0645\u0627 \u0623\u0647\u062a\u0645 \u0628\u0645\u0631\u0627\u0639\u0627\u062a\u0647\u0627 \u062e\u0627\u0631\u062c \u0627\u0644\u0645\u0646\u0632\u0644.","121 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0647\u0646\u0627\u0643 \u0645\u0624\u0627\u0645\u0631\u0629 \u062a\u062f\u0628\u0631 \u0636\u062f\u064a .","122 \u2013 \u064a\u0628\u062f\u0648 \u0623\u0646\u0646\u064a \u0644\u0627 \u0623\u0642\u0644 \u0646\u0628\u0627\u0647\u0629 \u0623\u0648 \u0642\u062f\u0631\u0629 \u0639\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644\u0645\u062d\u064a\u0637\u064a\u0646 \u0628\u064a .","123 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0647\u0646\u0627\u0643 \u0645\u0646 \u064a\u062a\u062a\u0628\u0639\u0646\u064a .","124 \u2013 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u064a\u0633\u062a\u062e\u062f\u0645\u0648\u0646 \u0648\u0633\u0627\u0626\u0644 \u0645\u0644\u062a\u0648\u064a\u0629 \u0644\u0644\u062d\u0635\u0648\u0644 \u0639\u0644\u0649 \u0643\u0633\u0628 \u0623\u0648 \u0645\u0646\u0641\u0639\u0629 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0623\u0646 \u064a\u062a\u0631\u0643\u0648\u0627 \u0627\u0644\u0641\u0631\u0635\u0629 \u062a\u0636\u064a\u0639 \u0639\u0644\u064a\u0647\u0645.","125 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u062a\u062a\u0639\u0628\u0646\u064a \u0645\u0639\u062f\u062a\u064a .","126 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0631\u0648\u0627\u064a\u0627\u062a \u0627\u0644\u0639\u0627\u0637\u0641\u064a\u0629 \u0627\u0644\u0639\u0646\u064a\u0641\u0629 . ","127 \u2013 \u0623\u0646\u0646\u064a \u0623\u0639\u0631\u0641 \u0645\u0646 \u0647\u0648 \u0627\u0644\u0645\u0633\u0626\u0648\u0644 \u0639\u0646 \u0645\u0639\u0638\u0645 \u0645\u062a\u0627\u0639\u0628\u064a.","128 \u2013 \u0631\u0624\u064a\u0629 \u0627\u0644\u062f\u0645 \u0644\u0627 \u062a\u0633\u0628\u0628 \u0644\u064a \u0627\u0644\u0631\u0639\u0628.","129 \u2013 \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0631\u0649 \u0641\u064a \u0623\u063a\u0644\u0628 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0633\u0628\u0628\u0623\u064b \u0644\u063a\u0636\u0628\u064a \u0623\u0648 \u0646\u0642\u0645\u062a\u064a \u0639\u0644\u0649 \u0627\u0644\u062d\u064a\u0627\u0629 .","130 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u062a\u0642\u064a\u0623\u062a \u062f\u0645\u0627\u064b \u0623\u0648 \u0633\u0639\u0644\u062a \u062f\u0645\u0627\u064b.","131 \u2013 \u0644\u0627 \u062a\u0642\u0644\u0642\u0646\u064a \u0641\u0643\u0631\u0629 \u0627\u0644\u0625\u0635\u0627\u0628\u0629 \u0628\u0627\u0644\u0645\u0631\u0636.","132 \u2013 \u0623\u062d\u0628 \u062c\u0645\u0639 \u0627\u0644\u0632\u0647\u0648\u0631 \u0648\u062a\u0631\u0628\u064a\u0629 \u0627\u0644\u0646\u0628\u0627\u062a\u0627\u062a \u0627\u0644\u0645\u0646\u0632\u0644\u064a\u0629 .","133 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u0623\u0646 \u0623\u0646\u063a\u0645\u0633\u062a \u0641\u064a \u0639\u0627\u062f\u0629 \u0645\u0646 \u0627\u0644\u0639\u0627\u062f\u0627\u062a \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u0627\u0644\u0634\u0627\u0630\u0629 .","134 \u2013 \u062a\u062a\u0648\u0627\u0631\u062f \u0627\u0644\u0623\u0641\u0643\u0627\u0631 \u0641\u064a \u0630\u0647\u0646\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0623\u0633\u0631\u0639 \u0645\u0645\u0627 \u0623\u0633\u062a\u0637\u0639 \u0623\u0646 \u0623\u0639\u0628\u0631 \u0628\u0647 .","135 \u2013 \u0645\u0646 \u0627\u0644\u062c\u0627\u0626\u0632 \u0623\u0646 \u0623\u062f\u062e\u0644 \u0627\u0644\u0633\u064a\u0646\u0645\u0627 \u062f\u0648\u0646 \u0623\u0646 \u0623\u062f\u0641\u0639 \u062b\u0645\u0646 \u0627\u0644\u062a\u0630\u0643\u0631\u0629 \u0625\u0630\u0627 \u062a\u0623\u0643\u062f\u062a \u0645\u0646 \u0623\u0646 \u0623\u062d\u062f\u0627\u064b \u0644\u0646 \u064a\u0631\u0627\u0646\u064a.","136 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u062a\u0633\u0627\u0621\u0644 \u0639\u0646 \u0627\u0644\u0623\u0633\u0628\u0627\u0628 \u0627\u0644\u0645\u0633\u062a\u062a\u0631\u0629 \u0627\u0644\u062a\u064a \u062a\u062f\u0641\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u0627\u0644\u0649 \u0645\u0639\u0648\u0646\u062a\u064a .","137 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u0645\u0646\u0632\u0644\u064a\u0629 \u062a\u0639\u0627\u062f\u0644 \u0645\u0646 \u062d\u064a\u062b \u0627\u0644\u0633\u0639\u0627\u062f\u0629 \u062d\u064a\u0627\u0629 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 \u0627\u0644\u0630\u064a\u0646 \u0623\u0639\u0631\u0641\u0647\u0645 . ","138 \u2013 \u0627\u0644\u0646\u0642\u062f \u0623\u0648 \u0627\u0644\u0644\u0648\u0645 \u064a\u062c\u0631\u062d\u0627\u0646 \u0634\u0639\u0648\u0631\u064a \u0625\u0644\u0649 \u062d\u062f \u0643\u0628\u064a\u0631.","139 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0643\u0645\u0627 \u0644\u0648 \u0643\u0627\u0646 \u0645\u0646 \u0627\u0644\u0636\u0631\u0648\u0631\u064a \u0623\u0646 \u0623\u0624\u0630\u064a \u0646\u0641\u0633\u064a \u0623\u0648 \u0623\u064a \u0634\u062e\u0635 \u0622\u062e\u0631 .","140 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u064c\u0642\u0648\u0645 \u0628\u0637\u0647\u064a \u0627\u0644\u0637\u0639\u0627\u0645 .","141 \u2013 \u062a\u062d\u062f\u062f \u0633\u0644\u0648\u0643\u064a \u0625\u0644\u0649 \u062d\u062f \u0643\u0628\u064a\u0631 \u0627\u0644\u062a\u0642\u0627\u0644\u064a\u062f \u0627\u0644\u0645\u062d\u064a\u0637\u0629 \u0628\u064a .","142 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0634\u0639\u0648\u0631\u0627\u064b \u0642\u0648\u064a\u0627\u064b \u0623\u0646\u0646\u064a \u0639\u062f\u064a\u0645 \u0627\u0644\u0641\u0627\u0626\u062f\u0629 .","143 \u2013 \u0643\u0646\u062a \u0623\u0646\u062a\u0645\u064a \u0641\u064a \u0637\u0641\u0648\u0644\u062a\u064a \u0625\u0644\u0649 \u062c\u0645\u0627\u0639\u0629 ( \u0634\u0644\u0629 ) \u0627\u062a\u0641\u0642\u062a \u0639\u0644\u0649 \u0623\u0646 \u062a\u062a\u062d\u062f \u0641\u064a \u0627\u0644\u0633\u0631\u0627\u0621 \u0648\u0627\u0644\u0636\u0631\u0627\u0621 .","144 \u2013 \u0623\u0648\u062f \u0623\u0646 \u0623\u0644\u062a\u062d\u0642 \u0628\u0627\u0644\u062c\u064a\u0634 .","145 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u0625\u0634\u062a\u0628\u0627\u0643 \u0628\u0627\u0644\u0623\u064a\u062f\u064a \u0645\u0639 \u0623\u064a \u0634\u062e\u0635.","146 \u2013 \u062a\u0646\u062a\u0627\u0628\u0646\u064a \u0631\u063a\u0628\u0629 \u0645\u0644\u062d\u0629 \u0641\u064a \u0627\u0644\u062a\u062c\u0648\u0644 \u0628\u062d\u062b \u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u0633\u0639\u0627\u062f\u0629 \u0625\u0644\u0627 \u0639\u0646\u062f\u0645\u0627 \u0623\u0646\u0641\u0630 \u0647\u0630\u0647 \u0627\u0644\u0631\u063a\u0628\u0629 \u0641\u0623\u062a\u062c\u0648\u0644 \u0623\u0648 \u0623\u0633\u0627\u0641\u0631.","147 \u2013 \u0641\u0642\u062f\u062a \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0646 \u0627\u0644\u0641\u0631\u0635 \u0644\u0623\u0646\u064a \u0644\u0645 \u0627\u0633\u062a\u0637\u0639 \u0623\u0646 \u0623\u0628\u062a \u0641\u064a \u0627\u0644\u0623\u0645\u0648\u0631 \u0628\u0635\u0648\u0631\u0629 \u0642\u0627\u0637\u0639\u0629.","148 \u2013 \u0625\u0646\u0646\u064a \u0623\u0641\u0642\u062f \u0635\u0628\u0631\u064a \u0625\u0630\u0627 \u0645\u0627 \u0642\u0627\u0637\u0639\u0646\u064a \u0627\u0644\u0646\u0627\u0633 \u0623\u062b\u0646\u0627\u0621 \u0625\u0633\u062a\u063a\u0627\u0644\u064a \u0628\u0623\u0645\u0631 \u0647\u0627\u0645.","149 \u2013 \u0645\u0646 \u0639\u0627\u062f\u062a\u064a \u0623\u0646 \u0623\u0643\u062a\u0628 \u064a\u0648\u0645\u064a\u0627\u062a\u064a .","150 \u2013 \u0623\u0641\u0636\u0644 \u0627\u0644\u0643\u0633\u0628 \u0639\u0644\u0649 \u0627\u0644\u062e\u0633\u0627\u0631\u0629 \u0641\u064a \u0627\u0644\u0644\u0639\u0628 .","151 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u064a\u062d\u0627\u0648\u0644 \u0623\u0646 \u064a\u062f\u0633 \u0627\u0644\u0633\u0645 \u0641\u064a \u0627\u0644\u0639\u0633\u0644.","152 \u2013 \u0623\u0646\u0627\u0645 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0644\u064a\u0627\u0644\u064a \u062f\u0648\u0646 \u0623\u0646 \u062a\u0636\u0627\u064a\u0642\u0646\u064a \u0627\u0644\u0623\u0641\u0643\u0627\u0631.","153 \u2013 \u0643\u0627\u0646\u062a \u0635\u062d\u062a\u064a \u0641\u064a \u062e\u0644\u0627\u0644 \u0627\u0644\u0633\u0646\u0648\u0627\u062a \u0627\u0644\u0642\u0644\u064a\u0644\u0629 \u0627\u0644\u0645\u0627\u0636\u064a\u0629 \u062c\u064a\u062f\u0629 \u0639\u0644\u0649 \u0648\u062c\u0647 \u0627\u0644\u0639\u0645\u0648\u0645.","154 \u2013 \u0644\u0645 \u0623\u0635\u0628 \u0645\u0637\u0644\u0642\u0627\u064b \u0628\u0623\u064a\u0629 \u0646\u0648\u0628\u0629 .","155 \u2013 \u0648\u0632\u0646\u064a \u0644\u0627 \u064a\u0632\u064a\u062f \u0648\u0644\u0627 \u064a\u0646\u0642\u0635.","156 \u2013 \u0645\u0631\u062a \u0628\u064a \u0641\u062a\u0631\u0627\u062a \u0643\u0646\u062a \u0623\u0642\u0648\u0645 \u0641\u064a\u0647\u0627 \u0628\u0623\u0641\u0639\u0627\u0644 \u062f\u0648\u0646 \u0623\u0646 \u0623\u0639\u0631\u0641 \u0628\u0639\u062f \u0630\u0644\u0643 \u0645\u0627\u0630\u0627 \u0643\u0646\u062a \u0623\u0641\u0639\u0644 .","157 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0623\u0646\u0646\u064a \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0639\u0648\u0642\u0628\u062a \u062f\u0648\u0646 \u0633\u0628\u0628 .","158 \u2013 \u0623\u0628\u0643\u064a \u0628\u0633\u0647\u0648\u0644\u0629 .","159 \u2013 \u0644\u0645 \u0623\u0639\u062f \u0623\u0641\u0647\u0645 \u0645\u0627 \u0623\u0642\u0631\u0623 \u0628\u0646\u0641\u0633 \u0627\u0644\u062f\u0631\u062c\u0629 \u0627\u0644\u062a\u064a \u0643\u0646\u062a \u0623\u0641\u0647\u0645 \u0633\u0627\u0628\u0642\u0627\u064b .","160 \u2013 \u0644\u0645 \u0623\u0634\u0639\u0631 \u0641\u064a \u064a\u0648\u0645 \u0645\u0646 \u0627\u0644\u0623\u064a\u0627\u0645 \u0628\u0623\u0646\u0646\u064a \u0623\u062d\u0633\u0646 \u0645\u0645\u0627 \u0623\u0646\u0627 \u0639\u0644\u064a\u0647 \u0627\u0644\u0622\u0646 .","161 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0642\u0645\u0629 \u0631\u0623\u0633\u064a \u0631\u062e\u0648\u0629 ( \u0637\u0631\u064a\u0629 ) .","162 \u2013 \u0644\u0627 \u0623\u064c\u0642\u0628\u0644 \u0623\u0646 \u064a\u0633\u062a\u063a\u0644\u0646\u064a \u0623\u062d\u062f \u0625\u0644\u0649 \u0627\u0644\u062d\u062f \u0627\u0644\u0630\u064a \u0644\u0627 \u0623\u062c\u062f \u0645\u0639\u0647 \u0645\u0641\u0631\u0627\u064b \u0645\u0646 \u0623\u0646 \u0623\u0639\u062a\u0631\u0641 \u0628\u0630\u0644\u0643 .","163 \u2013 \u0644\u0627 \u0623\u062a\u0639\u0628 \u0628\u0633\u0631\u0639\u0629 .","164 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u062f\u0631\u0633 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0627\u0644\u062a\u064a \u0623\u0634\u062a\u063a\u0644 \u0628\u0647\u0627 \u0648\u0623\u0646 \u0623\u0642\u0631\u0623 \u0639\u0646\u0647\u0627.","165 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u062a\u0639\u0631\u0641 \u0639\u0644\u0649 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644\u0645\u0647\u0645\u064a\u0645 \u0644\u0627\u0646 \u0630\u0644\u0643 \u064a\u0634\u0639\u0631\u0646\u064a \u0627\u0644\u0623\u0647\u0645\u064a\u0629 .","166 \u2013 \u0623\u062e\u0627\u0641 \u0639\u0646\u062f\u0645\u0627 \u0623\u0637\u0644 \u0645\u0646 \u0645\u0643\u0627\u0646 \u0639\u0627\u0644.","167 \u2013 \u0644\u0627 \u064a\u062b\u064a\u0631\u0646\u064a \u0623\u0646 \u064a\u0642\u0639 \u0623\u062d\u062f \u0623\u0641\u0631\u0627\u062f \u0639\u0627\u0626\u0644\u062a\u064a \u0641\u064a \u0645\u0623\u0632\u0642 \u0628\u0633\u0628\u0628 \u0645\u062e\u0627\u0644\u0641\u062a\u0647 \u0644\u0644\u0642\u0627\u0646\u0648\u0646.","168 \u2013 \u0623\u0634\u0639\u0631 \u0623\u0646 \u0639\u0642\u0644\u064a \u0645\u062e\u062a\u0644.","169 \u2013 \u0644\u0627 \u0623\u062e\u0634\u0649 \u0627\u0644\u062a\u0639\u0627\u0645\u0644 \u0628\u0627\u0644\u0646\u0642\u0648\u062f .","170 \u2013 \u0644\u0627 \u064a\u0647\u0645\u0646\u064a \u0645\u0627 \u064a\u0638\u0646\u0647 \u0627\u0644\u0646\u0627\u0633 \u0639\u0646\u064a.","171 \u2013 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u0646 \u0623\u0642\u0648\u0645 \u0628\u062f\u0648\u0631 \u0627\u0644\u0645\u0647\u0631\u062c \u0641\u064a \u062d\u0641\u0644\u0629 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0627\u0646 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u064a\u0642\u0648\u0645\u0648\u0646 \u0628\u0646\u0641\u0633 \u0627\u0644\u0634\u0626.","172 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0627\u0636\u0637\u0631 \u0627\u0644\u0649 \u0623\u0646 \u0623\u0628\u0630\u0644 \u0645\u062c\u0647\u0648\u062f\u0627\u064b \u0643\u0628\u064a\u0631\u0627\u064b \u0644\u0623\u062e\u0641\u0649 \u0645\u0627 \u0642\u062f \u064a\u0638\u0647\u0631 \u0645\u0646 \u062e\u062c\u0644\u064a .","173 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0645\u062f\u0631\u0633\u0629 .","174 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u0642\u0637 \u0623\u0646 \u0623\u063a\u0645\u0649 \u0639\u0644\u064a.","175 \u2013 \u0642\u0644\u0645\u0627 \u062d\u062f\u062b \u0623\u0646 \u0623\u0635\u0628\u062a \u0628\u062f\u0648\u062e\u0629.","176 \u2013 \u0644\u0627 \u0623\u062e\u0627\u0641 \u0627\u0644\u062b\u0639\u0627\u0628\u064a\u0646 \u0643\u062b\u064a\u0631\u0627\u064b .","177 \u2013 \u0623\u0645\u064a \u0633\u064a\u062f\u0629 \u0637\u064a\u0628\u0629 .","178 \u2013 \u064a\u0628\u062f\u0648 \u0623\u0646 \u0630\u0627\u0643\u0631\u062a\u064a \u0644\u0627 \u0628\u0623\u0633 \u0628\u0647\u0627.","179 \u2013 \u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u062a\u062b\u064a\u0631 \u0639\u0646\u062f\u064a \u0627\u0644\u0642\u0644\u0642.","180 \u2013 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0627\u0644\u062a\u062d\u062f\u062b \u0645\u0639 \u0627\u0644\u0646\u0627\u0633 \u0625\u0630\u0627 \u0643\u0627\u0646\u062a \u0645\u0639\u0631\u0641\u062a\u064a \u0628\u0647\u0645 \u062d\u062f\u064a\u062b\u0629.","181 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0639\u0645\u0644 \u0645\u062b\u064a\u0631 \u062d\u064a\u0646 \u064a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u0633\u0623\u0645 \u0623\u0648 \u0627\u0644\u0645\u0644\u0644 .","182 \u2013 \u0623\u062e\u0634\u0649 \u0623\u0646 \u064a\u0637\u064a\u0631 \u0635\u0648\u0627\u0628\u064a .","183 \u2013 \u0625\u0646\u0646\u064a \u0636\u062f \u0645\u0633\u0623\u0644\u0629 \u0625\u0639\u0637\u0627\u0621 \u0627\u0644\u0646\u0642\u0648\u062f \u0644\u0644\u0634\u062d\u0627\u0630\u064a\u0646.","184 \u2013 \u0623\u0633\u0645\u0639 \u0641\u064a \u0627\u0644\u0639\u0627\u062f\u0629 \u0623\u0635\u0648\u0627\u062a\u0627\u064b \u062f\u0648\u0646 \u0623\u0646 \u0623\u0639\u0631\u0641 \u0645\u0635\u062f\u0647\u0627.","185 \u2013 \u0633\u0645\u0639\u064a \u0644\u0627 \u064a\u0642\u0644 \u062c\u0648\u062f\u0629 \u0639\u0646 \u0633\u0645\u0639 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 .","186 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u0644\u0627\u062d\u0638 \u0623\u0646 \u064a\u062f\u0627\u064a \u062a\u0631\u062a\u062c\u0641\u0627\u0646 \u0639\u0646\u062f\u0645\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0642\u0648\u0645 \u0628\u0639\u0645\u0644 \u0645\u0627 .","187 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u0641\u0642\u062f\u062a \u064a\u062f\u0627\u064a \u0625\u062a\u0632\u0627\u0646\u0647\u0645\u0627 \u0623\u0648 \u0645\u0647\u0627\u0631\u062a\u0647\u0645\u0627 .","188 \u2013 \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u0642\u0631\u0627\u0621\u0629 \u0645\u062f\u0629 \u0637\u0648\u064a\u0644\u0629 \u062f\u0648\u0646 \u0623\u0646 \u062a\u062a\u0639\u0628 \u0639\u064a\u0646\u0627\u064a.","189 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0648\u0642\u0627\u062a \u0628\u0636\u0639\u0641 \u0639\u0627\u0645 .","190 \u2013 \u0642\u0644\u064a\u0644\u0627\u064b \u0645\u0627 \u0623\u0635\u0627\u0628 \u0628\u0627\u0644\u0635\u062f\u0627\u0639.","191 \u2013 \u0625\u0646\u0646\u064a \u0623\u062a\u0635\u0628\u0628 \u0639\u0631\u0642\u0627\u064b \u0639\u0646\u062f\u0645\u0627 \u0623\u062d\u0631\u062c \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646.","192 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u0648\u062c\u062f\u062a \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u062d\u0641\u0638 \u062a\u0648\u0627\u0632\u0646\u064a \u0641\u064a \u0627\u0644\u0645\u0634\u064a.","193 \u2013 \u0644\u0627 \u0623\u0634\u0643\u0648 \u0645\u0646 \u0646\u0648\u0628\u0627\u062a \u0627\u0644\u0631\u0628\u0648 \u0623\u0648 \u0646\u0648\u0628\u0627\u062a \u0627\u0644\u0632\u0643\u0627\u0645.","194 \u2013 \u062a\u062d\u062f\u062b \u0644\u064a \u0646\u0648\u0628\u0627\u062a \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0641\u064a\u0647\u0627 \u0623\u0646 \u0623\u0633\u064a\u0637\u0631 \u0639\u0644\u0649 \u062d\u0631\u0643\u0627\u062a\u064a \u0623\u0648 \u0639\u0644\u0649 \u0643\u0644\u0627\u0645\u064a \u0648\u0625\u0646 \u0643\u0646\u062a \u0623\u0634\u0639\u0631 \u0628\u0645\u0627 \u064a\u062f\u0648\u0631 \u062d\u0648\u0644\u064a.","195 \u2013 \u0644\u064a\u0633 \u0643\u0644 \u0645\u0646 \u0623\u0639\u0631\u0641\u0647 \u0623\u062d\u0628\u0647.","196 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0632\u0648\u0631 \u0627\u0644\u0623\u0645\u0627\u0643\u0646 \u0627\u0644\u062a\u064a \u0644\u0645 \u062a\u0633\u0628\u0642 \u0644\u064a \u0631\u0624\u064a\u062a\u0647\u0627.","197 \u2013 \u064a\u062d\u0627\u0648\u0644 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u0623\u0646 \u064a\u0646\u0628\u0647\u0646\u064a.","198 \u2013 \u0642\u0644\u064a\u0644\u0627\u064b \u0645\u0627 \u0623\u0633\u062a\u063a\u0631\u0642 \u0641\u064a \u0623\u062d\u0644\u0627\u0645 \u0627\u0644\u064a\u0642\u0638\u0629 .","199 \u2013 \u064a\u062c\u0628 \u0623\u0646 \u064a\u062a\u0639\u0644\u0645 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 \u062c\u0645\u064a\u0647 \u0627\u0644\u062d\u0642\u0627\u0626\u0642 \u0627\u0644\u0645\u062a\u0639\u0644\u0642\u0629 \u0628\u0627\u0644\u0646\u0648\u0627\u062d\u064a \u0627\u0644\u062c\u0646\u0633\u064a\u0629 .","200 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0647\u0646\u0627\u0643 \u0645\u0646 \u064a\u062d\u0627\u0648\u0644 \u0623\u0646 \u064a\u0633\u0631\u0642 \u0623\u0641\u0643\u0627\u0631\u064a \u0623, \u0646\u062a\u0627\u0626\u062c \u0623\u0639\u0645\u0627\u0644\u064a.","201 \u2013 \u0623\u062a\u0645\u0646\u0649 \u0644\u0648 \u0644\u0645 \u0623\u0643\u0646 \u062e\u062c\u0648\u0644\u0627\u064b \u0625\u0644\u0649 \u0647\u0630\u0627 \u0627\u0644\u062d\u062f .","202 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0646\u064a \u0634\u062e\u0635 \u0645\u0646\u062d\u0648\u0633 .","203 \u2013 \u0625\u0630\u0627 \u0643\u0646\u062a \u0635\u062d\u0641\u064a\u0627\u064b \u0641\u0625\u0646\u0646\u064a \u0623\u062d\u0628 \u0623\u0646 \u0623\u0646\u0642\u0644 \u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u062f\u0648\u0627\u0626\u0631 \u0627\u0644\u0645\u0633\u0631\u062d\u064a\u0629 .","204 \u2013 \u0623\u0648\u062f \u0623\u0646 \u0623\u0643\u0648\u0646 \u0635\u062d\u0641\u064a\u0627\u064b .","205 \u2013 \u0645\u0631\u062a \u0639\u0644\u064a \u0623\u0648\u0642\u0627\u062a \u0643\u0627\u0646 \u0645\u0646 \u0627\u0644\u0645\u0633\u062a\u062d\u064a\u0644 \u0639\u0644\u064a \u0641\u064a\u0647\u0627 \u0623\u0646 \u0623\u0645\u0646\u0639 \u0646\u0641\u0633\u064a \u0639\u0646 \u0633\u0631\u0642\u0629 \u0623\u0648 \u062e\u0637\u0641 \u0634\u0626.","206 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0646\u064a \u0623\u0634\u062f \u062a\u062f\u064a\u0646\u0627\u064b \u0645\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633.","207 \u2013 \u0623\u062c\u062f \u0645\u062a\u0639\u0629 \u0641\u064a \u0623\u0646\u0648\u0627\u0639 \u0643\u062b\u064a\u0631\u0629 \u0645\u0646 \u0627\u0644\u0623\u0644\u0639\u0627\u0628 \u0648\u0648\u0633\u0627\u0626\u0644 \u0627\u0644\u062a\u0631\u0648\u064a\u062d.","208 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u063a\u0627\u0632\u0644 \u0627\u0644\u062c\u0646\u0633 \u0627\u0644\u0622\u062e\u0631 .","209 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0630\u0646\u0648\u0628\u064a \u0644\u0627 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u063a\u0641\u0631.","210 \u2013 \u0643\u0644 \u0634\u0626 \u0641\u064a \u0646\u0638\u0631\u064a \u0633\u0648\u0627\u0621.","211 \u2013 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0646\u0627\u0645 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0646\u0647\u0627\u0631 \u0648\u0644\u0643\u0646 \u0644\u064a\u0633 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0644\u064a\u0644.","212 \u2013 \u0623\u0647\u0644\u064a \u064a\u0639\u0627\u0645\u0644\u0648\u0646\u064a \u0643\u0645\u0627 \u064a\u0639\u0627\u0645\u0644 \u0627\u0644\u0637\u0641\u0644 \u0644\u0627 \u0643\u0645\u0627 \u064a\u0639\u0627\u0645\u0644 \u0627\u0644\u0631\u0627\u0634\u062f.","213 \u2013 \u0623\u062a\u062d\u0627\u0634\u0649 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0645\u0634\u064a \u0639\u0644\u0649 \u0631\u0635\u064a\u0641 \u0627\u0644\u0634\u0627\u0631\u0639 \u0645\u062b\u0644\u0627\u064b \u0623\u0646 \u062a\u0633\u0642\u0637 \u0642\u062f\u0645\u064a \u0641\u064a \u0627\u0644\u0634\u0642\u0648\u0642 \u0627\u0644\u0645\u0648\u062c\u0648\u062f\u0629 \u0628\u064a\u0646 \u0643\u0644 \u062d\u062c\u0631 \u0648\u0622\u062e\u0631.","214 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u0623\u0635\u0628\u062a \u0628\u0637\u0641\u062d \u062c\u0644\u062f\u064a \u0633\u0628\u0628 \u0644\u064a \u0642\u0644\u0642\u0627\u064b .","215 \u2013 \u062a\u0639\u0627\u0637\u064a\u062a \u0627\u0644\u0645\u0634\u0631\u0648\u0628\u0627\u062a \u0627\u0644\u0631\u062d\u064a\u0629 ( \u0627\u0644\u062e\u0645\u0631 ) \u0628\u0643\u062b\u0631\u0629 .","216 \u2013 \u0647\u0646\u0627\u0643 \u0642\u0644\u064a\u0644 \u062c\u062f\u0627\u064b \u0645\u0646 \u0627\u0644\u062d\u0628 \u0648\u0627\u0644\u062a\u0622\u062e\u0649 \u0641\u064a \u0639\u0627\u0626\u0644\u062a\u064a \u0625\u0630\u0627 \u0642\u0648\u0631\u0646\u062a \u0628\u0627\u0644\u0639\u0627\u0626\u0644\u0627\u062a \u0627\u0644\u0623\u062e\u0631\u0649 .","217 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u062c\u062f \u0646\u0641\u0633\u064a \u0642\u0644\u0642\u0627\u064b \u0639\u0644\u0649 \u0623\u0645\u0631 \u0645\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 .","218 \u2013 \u0644\u0627 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u0646 \u0623\u0631\u0649 \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u0627\u062a \u062a\u062a\u0639\u0630\u0628.","219 \u2013 \u0623\u0648\u062f \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u0642\u0627\u0648\u0644 \u0645\u0628\u0627\u0646\u064a.","220 \u2013 \u0623\u062d\u0628 \u0648\u0627\u0644\u062f\u062a\u064a .","221 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0639\u0644\u0648\u0645.","222 \u2013 \u0644\u0627 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0637\u0644\u0628 \u0627\u0644\u0645\u0639\u0648\u0646\u0629 \u0645\u0646 \u0623\u0635\u062f\u0642\u0627\u0626\u064a \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0646\u062a \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0631\u062f \u0627\u0644\u062c\u0645\u064a\u0644.","223 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0635\u064a\u062f \u062d\u0628\u0627\u064b \u0634\u062f\u064a\u062f\u0627\u064b.","224 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u0639\u062a\u0631\u0636 \u0648\u0627\u0644\u062f\u064a \u0639\u0644\u0649 \u0646\u0648\u0639 \u0645\u0646 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u0623\u0631\u0627\u0641\u0642\u0647\u0645.",'225 \u2013 \u0623\u062d\u0628 \u0623\u0646 " \u0623\u062f\u0631\u062f\u0634" \u0642\u0644\u064a\u0644\u0627\u064b \u0645\u0646 \u062d\u064a\u0646 \u0644\u0622\u062e\u0631 .',"226 \u2013 \u0628\u0639\u0636 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u064a \u0644\u0647\u0645 \u0639\u0627\u062f\u0627\u062a \u062a\u0636\u0627\u064a\u0642\u0646\u064a \u0645\u0636\u0627\u064a\u0642\u0629 \u0634\u062f\u064a\u062f\u0629.","227 \u2013 \u0642\u064a\u0644 \u0644\u064a \u0623\u0646\u0646\u064a \u0623\u0645\u0634\u064a \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0646\u0648\u0645.","228 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646\u0646\u064a \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u062a\u062e\u0630 \u0627\u0644\u0642\u0631\u0627\u0631\u0627\u062a \u0628\u0633\u0647\u0648\u0644\u0629 \u063a\u064a\u0631 \u0639\u0627\u062f\u064a\u0629.","229 \u2013 \u0623\u0648\u062f \u0627\u0644\u0627\u0646\u062a\u0645\u0627\u0621 \u0625\u0644\u0649 \u0623\u0646\u062f\u064a\u0629 \u0648\u0647\u064a\u0626\u0627\u062a \u0639\u062f\u064a\u062f\u0629.","230 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u0642\u0637 \u0623\u0646 \u0634\u0639\u0631\u062a \u0628\u0634\u062f\u0629 \u062e\u0641\u0642\u0627\u0646 \u0642\u0644\u0628\u064a \u0623\u0648 \u0623\u0635\u0628\u062a \u0628\u0636\u064a\u0642 \u0641\u064a \u0627\u0644\u062a\u0646\u0641\u0633.","231 \u2013 \u0623\u062d\u0628 \u0627\u0644\u062a\u062d\u062f\u062b \u0641\u064a \u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u062c\u0646\u0633\u064a\u0629 .","232 \u2013 \u0627\u0644\u0647\u0645\u062a \u062e\u0637\u0629 \u0641\u064a \u0627\u0644\u062d\u064a\u0627\u0629 \u062a\u0642\u0648\u0645 \u0639\u0644\u0649 \u0627\u0633\u0627\u0633 \u0627\u062f\u0627\u0621 \u0627\u0644\u0648\u0627\u062c\u0628 \u060c \u0648\u0644\u0627 \u0627\u0632\u0627\u0644 \u0627\u062a\u0628\u0639\u0647\u0627 \u0628\u062f\u0642\u0629.","233 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0627 \u0627\u0639\u062a\u0631\u0636\u062a \u0637\u0631\u064a\u0642 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u0648\u0645\u0646\u0639\u062a\u0647\u0645 \u0645\u0646 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0627\u0639\u0645\u0627\u0644 \u0645\u0639\u064a\u0646\u0629 \u0644\u0627 \u0644\u0634\u0626 \u0625\u0644\u0627 \u0627\u0644\u0645\u0628\u062f\u0623.","234 \u2013 \u0623\u063a\u0636\u0628 \u0628\u0633\u0647\u0648\u0644\u0629 \u0648\u0644\u0643\u0646 \u0633\u0631\u0639\u0627\u0646 \u0645\u0627 \u0623\u0639\u0648\u062f \u0625\u0644\u0649 \u062d\u0627\u0644\u062a\u064a \u0627\u0644\u0637\u0628\u064a\u0639\u064a\u0629.","235 \u2013 \u0646\u0634\u0623\u062a \u0645\u0633\u062a\u0642\u0644\u0627\u064b \u062a\u0645\u0627\u0645 \u0627\u0644\u0627\u0633\u062a\u0642\u0644\u0627\u0644 \u0648\u0645\u062a\u062d\u0631\u0631\u0627\u064b \u0645\u0646 \u0633\u0644\u0637\u0629 \u0627\u0644\u0639\u0627\u0626\u0644\u0629 .","236 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0627\u0633\u062a\u063a\u0631\u0642 \u0641\u064a \u0627\u0644\u062a\u0641\u0643\u064a\u0631 .","237 \u2013 \u062c\u0645\u064a\u0639 \u0623\u0642\u0627\u0631\u0628\u064a \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u064a\u0639\u0637\u0641\u0648\u0646 \u0639\u0644\u064a.","238 \u2013 \u062a\u0645\u0631 \u0628\u064a \u0641\u062a\u0631\u0627\u062a \u0645\u0646 \u0639\u062f\u0645 \u0627\u0644\u0627\u0633\u062a\u0642\u0631\u0627\u0631 \u0628\u062d\u062b \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0627\u0646 \u0627\u0645\u0643\u062b \u0637\u0648\u064a\u0644\u0627\u064b \u0641\u064a \u0645\u0642\u0639\u062f\u064a.","239 \u2013 \u0641\u0634\u0644\u062a \u0641\u064a \u0627\u0644\u062d\u0628 .","240 \u2013 \u0644\u0627 \u0627\u0647\u062a\u0645 \u0645\u0637\u0644\u0642\u0627\u064b \u0628\u0645\u0638\u0647\u0631\u064a .","241 \u2013 \u0627\u062d\u0644\u0645 \u0639\u0627\u062f\u0629 \u0628\u0623\u0634\u064a\u0627\u0621 \u0623\u0641\u0636\u0644 \u0623\u0646 \u0627\u062d\u062a\u0641\u0638 \u0628\u0647\u0627 \u0644\u0646\u0641\u0633\u064a.","242 \u2013 \u0644\u0633\u062a \u0639\u0635\u0628\u064a\u0627\u064b \u0628\u062f\u0631\u062c\u0629 \u0623\u0643\u0628\u0631 \u0645\u0645\u0627 \u0639\u0644\u064a\u0647 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633.","243 \u2013 \u0644\u0627 \u0627\u0634\u0643\u0648 \u0645\u0646 \u0622\u0644\u0627\u0645 \u0625\u0644\u0627 \u0642\u0644\u064a\u0644\u0627\u064b \u062c\u062f\u0627\u064b \u0644\u062f\u0631\u062c\u0629 \u0627\u0644\u0639\u062f\u0645.","244 \u2013 \u064a\u0633\u0626 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u0639\u0627\u062f\u0629 \u0641\u0647\u0645 \u0637\u0631\u064a\u0642\u062a\u064a \u0641\u064a \u0627\u0644\u062a\u0635\u0631\u0641 .","245 \u2013 \u0648\u0627\u0644\u062f\u064a \u0648\u0639\u0627\u0626\u0644\u062a\u064a \u064a\u0628\u0627\u0644\u063a\u0648\u0646 \u0641\u064a \u062a\u0635\u0648\u064a\u0631 \u0639\u064a\u0648\u0628\u064a.","246 \u2013 \u062a\u0638\u0647\u0631 \u062d\u0628\u0648\u0628 \u062d\u0645\u0631\u0627\u0621 \u0639\u0644\u0649 \u0631\u0642\u0628\u062a\u064a \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u0648\u0642\u0627\u062a","247 \u2013 \u0639\u0646\u062f\u064a \u0645\u0646 \u0627\u0644\u0623\u0633\u0628\u0627\u0628 \u0645\u0627 \u064a\u062c\u0639\u0644\u0646\u064a \u0623\u0639\u0627\u0631\u0636 \u0628\u0639\u0636 \u0623\u0641\u0631\u0627\u062f \u0639\u0627\u0626\u0644\u062a\u064a.","248 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0634\u0639\u0631 \u0628\u0633\u0639\u0627\u062f\u0629 \u0648\u0627\u0646\u0634\u0631\u0627\u062d \u0639\u0638\u064a\u0645\u064a\u0646 \u0628\u062f\u0648\u0646 \u0623\u064a \u0633\u0628\u0628 \u060c \u0628\u0644 \u0648\u0639\u0646\u062f\u0645\u0627 \u062a\u0643\u0648\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 \u0633\u0627\u0626\u0631\u0629 \u0639\u0644\u0649 \u063a\u064a\u0631 \u0645\u0627 \u0623\u0634\u062a\u0647\u0649 .","249 \u2013 \u0623\u0639\u062a\u0642\u062f \u0628\u0648\u062c\u0648\u062f \u0627\u0644\u0634\u064a\u0627\u0637\u064a\u0646 \u0648\u0648\u062c\u0648\u062f \u0627\u0644\u062c\u062d\u064a\u0645 \u0641\u064a \u0627\u0644\u062d\u064a\u0627\u0629 \u0627\u0644\u0623\u062e\u0631\u0649.","250 \u2013 \u0644\u0627 \u0627\u0644\u0648\u0645 \u0623\u064a \u0634\u062e\u0635 \u064a\u062d\u0627\u0648\u0644 \u0623\u0646 \u064a\u062e\u0635\u0644 \u0644\u0646\u0641\u0633\u0647 \u0639\u0644\u0649 \u0645\u0627 \u064a\u0645\u0643\u0646 \u0623\u0646 \u062a\u0642\u0639 \u0639\u0644\u064a\u0647 \u064a\u062f\u0627\u0647 \u0641\u064a \u0647\u0630\u0627 \u0627\u0644\u0639\u0627\u0644\u0645 .","251 \u2013 \u062a\u0635\u064a\u0628\u0646\u064a \u0646\u0648\u0628\u0627\u062a \u064a\u062a\u0648\u0642\u0641 \u0641\u064a\u0647\u0627 \u0646\u0634\u0627\u0637\u064a \u0648\u0644\u0627 \u0623\u0634\u0639\u0631 \u0641\u064a\u0647\u0627 \u0628\u0645\u0627 \u064a\u062f\u0648\u0631 \u062d\u0648\u0644\u064a .","252 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0627\u0644\u0646\u0627\u0633 \u0644\u0627 \u064a\u0639\u0628\u0623\u0648\u0646 \u0628\u0645\u0627 \u064a\u062d\u062f\u062b \u0644\u0644\u0622\u062e\u0631\u064a\u0646.","253 \u2013 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0628\u0642\u0649 \u0635\u0644\u062a\u064a \u0628\u0623\u0648\u0644\u0626\u0643 \u0627\u0644\u0630\u064a\u0646 \u062a\u0635\u062f\u0631 \u0645\u0646\u0647\u0645 \u0623\u0641\u0639\u0627\u0644 \u0623\u0639\u062a\u0628\u0631\u0647\u0627 \u062e\u0637\u0623 .","254 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u0639 \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u064a\u062a\u0628\u0627\u062f\u0644 \u0623\u0641\u0631\u0627\u062f\u0647\u0627 \u0627\u0644\u0646\u0643\u0627\u062a .","255 \u2013 \u0642\u062f \u064a\u062d\u062f\u062b \u0623\u0646 \u0623\u0639\u0637\u0649 \u0635\u0648\u062a\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0644\u0623\u0634\u062e\u0627\u0635 \u0644\u0627 \u0623\u0639\u0631\u0641 \u0639\u0646\u0647\u0645 \u0625\u0644\u0627 \u0627\u0644\u0642\u0644\u064a\u0644 .","256 \u2013 \u0627\u0644\u0634\u0626 \u0627\u0644\u0648\u062d\u064a\u062f \u0627\u0644\u0630\u064a \u064a\u062b\u064a\u0631 \u0627\u0647\u062a\u0645\u0627\u0645\u064a \u0641\u064a \u0627\u0644\u062c\u0631\u0627\u0626\u062f \u0623\u0648 \u0627\u0644\u0645\u062c\u0644\u0627\u062a \u0647\u0648 \u0627\u0644\u062c\u0632\u0621 \u0627\u0644\u0641\u0643\u0627\u0647\u064a.","257 \u2013 \u0623\u062a\u0648\u0642\u0639 \u0639\u0627\u062f\u0629 \u0623\u0646 \u0623\u0646\u062c\u062d \u0641\u064a\u0645\u0627 \u0623\u0642\u0648\u0645 \u0628\u0647.","258 \u2013 \u0623\u0639\u062a\u0642\u062f \u0628\u0648\u062c\u0648\u062f \u0627\u0644\u0644\u0647.","259 \u2013 \u0623\u062c\u062f \u0623\u0646 \u0645\u0646 \u0627\u0644\u0635\u0639\u0628 \u0639\u0644\u0649 \u0623\u0646 \u0623\u0628\u062f\u0623 \u0639\u0645\u0644\u0627\u064b \u0645\u0646 \u0627\u0644\u0623\u0639\u0645\u0627\u0644.","260 \u2013 \u0643\u0646\u062a \u0645\u062a\u0623\u062e\u0631\u0627\u064b \u0641\u064a \u062f\u0631\u0627\u0633\u062a\u064a.","261 \u2013 \u0644\u0648 \u0643\u0646\u062a \u0641\u0646\u0627\u0646\u0627\u064b \u0644\u0648\u062f\u062f\u062a \u0623\u0646 \u0623\u0631\u0633\u0645 \u0632\u0647\u0648\u0631\u0627\u064b.","262 \u2013 \u0644\u0627 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u0646\u0646\u064a \u0644\u0633\u062a \u0623\u062d\u0633\u0646 \u0634\u0643\u0644\u0627\u064b \u0645\u0645\u0627 \u0623\u0646\u0627 \u0639\u0644\u064a\u0647.","263 \u2013 \u0623\u0639\u0631\u0642 \u0628\u0633\u0647\u0648\u0644\u0629 \u062d\u062a\u0649 \u0641\u064a \u0627\u0644\u062c\u0648 \u0627\u0644\u0628\u0627\u0631\u062f.","264 \u2013 \u0623\u0646\u0627 \u0648\u0627\u062b\u0642 \u0643\u0644 \u0627\u0644\u062b\u0642\u0629 \u0641\u064a \u0646\u0641\u0633\u064a .","265 \u2013 \u0645\u0646 \u0627\u0644\u0623\u0633\u0644\u0645 \u0627\u0644\u0627 \u064a\u062b\u0642 \u0627\u0644\u0627\u0646\u0633\u0627\u0646 \u0628\u0623\u062d\u062f","266 \u2013 \u064a\u0647\u062a\u0627\u062c \u0634\u0639\u0648\u0631\u064a \u0645\u0631\u0629 \u0623\u0648 \u0623\u0643\u062b\u0631 \u0641\u064a \u0627\u0644\u0623\u0633\u0628\u0648\u0639.","267 \u2013 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0627\u0644\u062a\u0641\u0643\u064a\u0631 \u0641\u064a \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u0645\u0646\u0627\u0633\u0628\u0629 \u0644\u0644\u062d\u062f\u064a\u062b \u060c \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0641\u064a \u0648\u0633\u0637 \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633.","268 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u064a\u0646\u0642\u0630\u0646\u064a \u0634\u0626 \u0645\u062b\u064a\u0631 \u0645\u0646 \u062d\u0627\u0644\u0627\u062a \u0627\u0644\u0627\u0646\u0642\u0628\u0627\u0636 \u0627\u0644\u062a\u064a \u0623\u0642\u0639 \u0641\u064a\u0647\u0627.","269 \u2013 \u064a\u0645\u0643\u0646 \u0628\u0633\u0647\u0648\u0644\u0629 \u0623\u0646 \u0623\u062e\u064a\u0641 \u0627\u0644\u0646\u0627\u0633 \u0645\u0646\u0649 \u0648\u0623\u0641\u0639\u0644 \u0630\u0644\u0643 \u0627\u062d\u064a\u0627\u0646\u0627\u064b \u0644\u0644\u062a\u0633\u0644\u064a\u0629.","270 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u063a\u0627\u062f\u0631 \u0627\u0644\u0645\u0646\u0632\u0644 \u0644\u0627 \u064a\u0646\u062a\u0627\u0628\u0646\u064a \u0627\u0644\u0636\u064a\u0642 \u0623\u0648 \u0627\u0644\u0634\u0643 \u0641\u064a \u0623\u0646 \u0623\u0643\u0648\u0646 \u0642\u062f \u062a\u0631\u0643\u062a \u0627\u0644\u0646\u0648\u0627\u0641\u0630 \u0645\u0641\u062a\u0648\u062d\u0629 \u0623\u0648 \u0627\u0644\u0628\u0627\u0628 \u063a\u064a\u0631 \u0645\u063a\u0644\u0642.","271 \u2013 \u0625\u0646\u0646\u064a \u0644\u0627 \u0623\u0644\u0648\u0645 \u0623\u064a \u0634\u062e\u0635 \u064a\u0633\u062a\u063a\u0644 \u0645\u0646 \u064a\u0639\u0631\u0636 \u0646\u0641\u0633\u0647 \u0644\u0644\u0625\u0633\u062a\u063a\u0644\u0627\u0644 .","272 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0623\u0646\u0646\u064a \u0645\u0645\u0644\u0648\u0621 \u0646\u0634\u0627\u0637\u0627\u064b ","273 \u2013 \u0627\u0641\u0642\u062f \u0627\u0644\u0625\u062d\u0633\u0627\u0633 \u0641\u064a \u0645\u0646\u0637\u0642\u0629 \u0623\u0648 \u0623\u0643\u062b\u0631 \u0645\u0646 \u062c\u0644\u062f\u064a.","274 \u2013 \u0644\u0645 \u064a\u0636\u0639\u0641 \u0628\u0635\u0631\u064a \u0639\u0645\u0627 \u0643\u0627\u0646 \u0639\u0644\u064a\u0647 \u0645\u0646 \u0639\u062f\u0629 \u0633\u0646\u0648\u0627\u062a.","275 \u2013 \u0623\u0634\u0639\u0631 \u0623\u0646 \u0634\u062e\u0635\u0627\u064b \u0645\u0627 \u064a\u0633\u064a\u0637\u0631 \u0639\u0644\u0649 \u0639\u0642\u0644\u064a.","276 \u2013 \u0623\u062c\u062f \u0645\u062a\u0639\u0629 \u0643\u0628\u064a\u0631\u0629 \u0645\u0639 \u0627\u0644\u0623\u0637\u0641\u0627\u0644.","277 \u2013 \u0623\u0639\u062c\u0628 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0645\u0647\u0627\u0631\u0629 \u0628\u0639\u0636 \u0627\u0644\u0646\u0635\u0627\u0628\u064a\u0646 \u0644\u062f\u0631\u062c\u0629 \u0623\u0646\u0646\u064a \u0623\u0631\u062c\u0648 \u0644\u0647\u0645 \u0627\u0644\u0646\u062c\u0627\u062d \u0641\u064a\u0645\u0627 \u064a\u0642\u0648\u0645\u0648\u0646 \u0628\u0647.","278 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u0634\u0639\u0631 \u0623\u0646 \u0628\u0639\u0636 \u0627\u0644\u063a\u0631\u0628\u0627\u0621 \u064a\u0646\u0638\u0631\u0648\u0646 \u0625\u0644\u0649 \u0628\u0639\u064a\u0646 \u0627\u0644\u0646\u0642\u062f.","279 \u2013 \u0623\u0634\u0631\u0628 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621 \u064a\u0648\u0645\u064a\u0627\u064b \u0645\u0642\u0627\u062f\u064a\u0631 \u0643\u0628\u064a\u0631\u0629 \u0628\u0634\u0643\u0644 \u063a\u064a\u0631 \u0639\u0627\u062f\u064a.","280 \u2013 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u064a\u0643\u0648\u0646\u0648\u0646 \u0635\u062f\u0627\u0642\u0627\u062a\u0647\u0645 \u0639\u0644\u0649 \u0623\u0633\u0627\u0633 \u0627\u062d\u062a\u0645\u0627\u0644 \u0627\u0644\u0627\u0641\u0627\u062f\u0629 \u0645\u0646 \u0623\u0635\u062f\u0642\u0627\u0626\u0647\u0645.","281 \u2013 \u0644\u0627 \u0627\u0634\u0639\u0631 \u063a\u0627\u0644\u0628\u0627\u064b \u0628\u0637\u0646\u064a\u0646 \u0623\u0648 \u0631\u0646\u064a\u0646 \u0641\u064a \u0623\u0630\u0646\u064a .","282 \u2013 \u0623\u0634\u0639\u0631 \u0645\u0646 \u062d\u064a\u0646 \u0644\u0622\u062e\u0631 \u0628\u0643\u0631\u0627\u0647\u064a\u0629 \u0646\u062d\u0648 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u064a \u0627\u0644\u062a\u064a \u0623\u062d\u0628\u0647\u0627 \u0641\u064a \u0627\u0644\u0639\u0627\u062f\u0629.","283 \u2013 \u0644\u0648 \u0643\u0646\u062a \u0645\u062e\u0628\u0631\u0627\u064b \u0635\u062d\u064a\u0641\u0627\u064b \u0644\u0648\u062f\u062f\u062a \u0623\u0646 \u0623\u0646\u0642\u0644 \u0623\u062e\u0628\u0627\u0631 \u0627\u0644\u0631\u064a\u0627\u0636\u0629.","284 \u2013 \u0625\u0646\u0646\u064a \u0648\u0627\u062b\u0642 \u0645\u0646 \u0623\u0646 \u0627\u0644\u0646\u0627\u0633 \u064a\u062a\u0643\u0644\u0645\u0648\u0646 \u0639\u0646\u064a.","285 \u2013 \u0623\u0636\u062d\u0643 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0646 \u0627\u0644\u0646\u0643\u062a \u0627\u0644\u062a\u064a \u0642\u062f \u062a\u062e\u0631\u062c \u0639\u0646 \u062d\u062f\u0648\u062f \u0627\u0644\u0644\u064a\u0627\u0642\u0629.","286 \u2013 \u0625\u0646\u0646\u064a \u0623\u0633\u0639\u062f \u0645\u0627 \u0623\u0643\u0648\u0646 \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0648\u062d\u064a\u062f\u0627\u064b .","287 \u2013 \u0645\u062e\u0627\u0648\u0641\u064a \u0642\u0644\u064a\u0644\u0629 \u0625\u0630\u0627 \u0642\u0648\u0631\u0646\u062a \u0628\u0645\u062e\u0627\u0648\u0641 \u0623\u0635\u062f\u0642\u0627\u0626\u064a.","288 \u2013 \u062a\u0632\u0639\u062c\u0646\u064a \u0646\u0648\u0628\u0627\u062a \u0645\u0646 \u0627\u0644\u0625\u0645\u0627\u0621 \u0648\u0627\u0644\u0642\u0626.","289 \u2013 \u064a\u0632\u062f\u0627\u062f \u0627\u0634\u0645\u0626\u0632\u0627\u0632\u064a \u0645\u0646 \u0627\u0644\u0642\u0627\u0646\u0648\u0646 \u0643\u0644\u0645\u0627 \u0648\u062c\u062f\u062a \u0628\u0639\u0636 \u0627\u0644\u0645\u062c\u0631\u0645\u064a\u0646 \u0642\u062f \u0646\u062c\u0627 \u0645\u0646 \u0627\u0644\u0639\u0642\u0627\u0628 \u0628\u0641\u0636\u0644 \u0645\u0647\u0627\u0631\u0629 \u0645\u062d\u0627\u0645 \u0642\u062f\u064a\u0631.","290 \u2013 \u0625\u0646\u0646\u064a \u0627\u0639\u0645\u0644 \u062a\u062d\u062a \u062a\u0648\u062a\u0631 \u0639\u0635\u0628\u064a \u0639\u0646\u064a\u0641.","291 \u2013 \u062d\u062f\u062b \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0634\u0639\u0631\u062a \u0628\u0623\u0646 \u0634\u062e\u0635\u0627\u064b \u0645\u0627 \u064a\u062f\u0641\u0639\u0646\u064a \u0625\u0644\u0649 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0623\u0639\u0645\u0627\u0644 \u0639\u0646 \u0637\u0631\u064a\u0642 \u062a\u0646\u0648\u064a\u0645\u064a \u0645\u063a\u0646\u0627\u0637\u064a\u0633\u064a\u0627\u064b.","292 \u2013 \u0644\u0627 \u0623\u0628\u062f\u0623 \u0627\u0644\u0646\u0627\u0633 \u0639\u0627\u062f\u0629 \u0628\u0627\u0644\u062d\u062f\u064a\u062b \u0645\u0627 \u0644\u0645 \u064a\u0628\u062f\u0623\u0648\u0646\u064a \u0647\u0645.","293 \u2013 \u0623\u0634\u0639\u0631 \u0623\u0646 \u0634\u062e\u0635\u0627\u064b \u0645\u0627 \u064a\u062d\u0627\u0648\u0644 \u0623\u0646 \u064a\u0624\u062b\u0631 \u0639\u0644\u0649 \u0639\u0642\u0644\u064a.","294 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0642\u0637 \u0623\u0646 \u0623\u0635\u0637\u062f\u0645\u062a \u0628\u0627\u0644\u0642\u0627\u0646\u0648\u0646.","295 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0642\u0635\u0635 \u0627\u0644\u062e\u064a\u0627\u0644\u064a\u0629.","296 \u2013 \u062a\u0645\u0631 \u0639\u0644\u064a \u0641\u062a\u0631\u0627\u062a \u0623\u0634\u0639\u0631 \u0641\u064a\u0647\u0627 \u0628\u0627\u0646\u0634\u0631\u0627\u062d \u062f\u0648\u0646 \u0633\u0628\u0628 \u0638\u0627\u0647\u0631.","267 \u2013 \u0623\u062a\u0645\u0646\u0649 \u0623\u0644\u0627 \u062a\u0636\u0627\u064a\u0642\u0646\u064a \u0627\u0644\u0623\u0641\u0643\u0627\u0631 \u0627\u0644\u062c\u0646\u0633\u064a\u0629.","298 \u2013 \u0625\u0630\u0627 \u0648\u062c\u062f\u062a \u0645\u062c\u0645\u0648\u0639\u0629 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u0623\u0646\u0647\u0627 \u0641\u064a \u0645\u0623\u0632\u0642 \u0641\u0627\u0644\u0623\u0641\u0636\u0644 \u0623\u0646 \u064a\u062a\u0641\u0642\u0648\u0627 \u0639\u0644\u0649 \u0642\u0635\u0629 \u0648\u0627\u062d\u062f\u0629 \u0648\u064a\u0644\u062a\u0632\u0645\u0648\u0646\u0647\u0627 \u062c\u0645\u064a\u0639\u0627\u064b.","299 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646\u0646\u064a \u0623\u0639\u0645\u0642 \u0634\u0639\u0648\u0631\u0627\u064b \u0645\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633.","300 \u2013 \u0644\u0645 \u0623\u062d\u0628 \u0641\u064a \u0623\u064a \u0641\u062a\u0631\u0629 \u0645\u0646 \u0641\u062a\u0631\u0627\u062a \u062d\u064a\u0627\u062a\u064a \u0623\u0646 \u0623\u0644\u0639\u0628 \u0628\u0627\u0644\u0639\u0631\u0627\u0626\u0633.","301 \u2013 \u0627\u0644\u062d\u064a\u0627\u0629 \u0635\u0639\u0628\u0629 \u0644\u064a \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646.","302 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0644\u064a \u0623\u0646 \u0648\u0642\u0639\u062a \u0641\u064a \u0645\u0627\u0632\u0642 \u0644\u0623\u0633\u0628\u0627\u0628 \u062a\u062a\u0639\u0644\u0642 \u0628\u0627\u0644\u0633\u0644\u0648\u0643 \u0627\u0644\u062c\u0646\u0633\u064a.","303 \u2013 \u0625\u0646\u0646\u064a \u0634\u062f\u064a\u062f \u0627\u0644\u062d\u0633\u0627\u0633\u064a\u0629 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0628\u0639\u0636 \u0627\u0644\u0645\u0648\u0636\u0648\u0639\u0627\u062a \u0644\u062f\u0631\u062c\u0629 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u062a\u062d\u062f\u062b \u0641\u064a\u0647\u0627 .","304 \u2013 \u0643\u0646\u062a \u0623\u062c\u062f \u0648\u0627\u0646\u0627 \u0641\u064a \u0627\u0644\u0645\u062f\u0631\u0633\u0629 \u0623\u0646 \u0645\u0646 \u0627\u0644\u0635\u0639\u0628 \u0639\u0644\u064a \u0623\u0646 \u0623\u062a\u062d\u062f\u062b \u0623\u0645\u0627\u0645 \u0627\u0644\u0641\u0635\u0644.","305 - \u0623\u0634\u0639\u0631 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u064a\u0627\u0645 \u0628\u0627\u0644\u0648\u062d\u062f\u0629 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0646\u062a \u0645\u0639 \u0622\u062e\u0631\u064a\u0646.","306 \u2013 \u0625\u0646\u0646\u064a \u062d\u0627\u0635\u0644 \u0639\u0644\u0649 \u0643\u0644 \u0645\u0627 \u0623\u0633\u062a\u062d\u0642\u0647 \u0645\u0646 \u0627\u0644\u0639\u0637\u0641.","307 \u2013 \u0623\u0631\u0641\u0636 \u0627\u0644\u0625\u0634\u062a\u0631\u0627\u0643 \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u0644\u0639\u0627\u0628 \u0627\u0644\u062a\u064a \u0644\u0627 \u0623\u062c\u064a\u062f\u0647\u0627.","308 \u2013 \u0623\u0631\u063a\u0628 \u0628\u0634\u062f\u0629 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0641\u064a \u0645\u063a\u0627\u062f\u0631\u0629 \u0627\u0644\u0645\u0646\u0632\u0644.","309 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0623\u0646\u0646\u064a \u0623\u0643\u0648\u0646 \u0635\u062f\u0627\u0642\u0627\u062a\u064a \u0628\u0646\u0641\u0633 \u0627\u0644\u0633\u0631\u0639\u0629 \u0627\u0644\u062a\u064a \u064a\u0643\u0648\u0646 \u0628\u0647\u0627 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u0635\u062f\u0627\u0642\u0627\u062a\u0647\u0645.","310 \u2013 \u0625\u0646\u0646\u064a \u0631\u0627\u0636 \u0639\u0646 \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u0628\u0648\u062c\u0647 \u0639\u0627\u0645.","311 \u2013 \u0623\u0631\u062a\u0643\u0628\u062a \u0628\u0639\u0636 \u0627\u0644\u0633\u0631\u0642\u0627\u062a \u0627\u0644\u0628\u0633\u064a\u0637\u0629 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0637\u0641\u0644\u0627\u064b \u0635\u063a\u064a\u0631\u0627\u064b.","312 \u2013 \u0623\u0643\u0631\u0647 \u0648\u062c\u0648\u062f \u0627\u0644\u0646\u0627\u0633 \u062d\u0648\u0644\u064a.","313 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u064a\u062a\u0631\u0643 \u0623\u0634\u064a\u0627\u0621 \u062b\u0645\u064a\u0646\u0629 \u0639\u0631\u0636\u0629 \u0644\u0644\u0633\u0631\u0642\u0629 \u064a\u0633\u062a\u062d\u0642 \u0645\u0646 \u0627\u0644\u0644\u0648\u0645 \u0628\u0642\u062f\u0631 \u0645\u0627 \u064a\u0633\u062a\u062d\u0642\u0647 \u0627\u0644\u0644\u0635 \u0627\u0644\u0630\u064a \u064a\u0633\u0631\u0642\u0647\u0627.","314 \u2013 \u0623\u0641\u0643\u0631 \u0645\u0646 \u062d\u064a\u0646 \u0644\u0622\u062e\u0631 \u0641\u064a \u0623\u0634\u064a\u0627\u0621 \u0645\u0646 \u0627\u0644\u0642\u0628\u062d \u0628\u062d\u064a\u062b \u0644\u0627 \u064a\u0635\u062d \u0627\u0644\u062a\u062d\u062f\u062b \u0639\u0646\u0647\u0627.","315 \u2013 \u0623\u0646\u0627 \u0648\u0627\u062b\u0642 \u0645\u0646 \u0625\u0646\u0646\u064a \u0645\u0638\u0644\u0648\u0645 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u064a\u0627\u0629.","316 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0643\u0644 \u0634\u062e\u0635 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0642\u062f \u064a\u0643\u0630\u0628 \u0644\u064a\u062a\u062c\u0646\u0628 \u0627\u0644\u0648\u0642\u0648\u0639 \u0641\u064a \u0627\u0644\u0645\u0622\u0632\u0642.","317 \u2013 \u0625\u0646\u0646\u064a \u0623\u0643\u062b\u0631 \u062d\u0633\u0627\u0633\u064a\u0629 \u0645\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 .","318 \u2013 \u062d\u064a\u0627\u062a\u064a \u0627\u0644\u064a\u0648\u0645\u064a\u0629 \u0645\u0645\u0644\u0648\u0621\u0629 \u0628\u0645\u0627 \u064a\u062b\u064a\u0631 \u0623\u0647\u062a\u0645\u0627\u0645\u064a .","319 \u2013 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 \u064a\u0643\u0631\u0647 \u0641\u064a \u0642\u0631\u0627\u0631\u0629 \u0646\u0641\u0633\u0647 \u0623\u0646 \u064a\u0633\u0627\u0639\u062f \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","320 \u2013 \u0643\u062b\u064a\u0631 \u0645\u0646 \u0623\u062d\u0644\u0627\u0645\u064a \u064a\u062a\u0639\u0644\u0642 \u0628\u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u062c\u0646\u0633\u064a\u0629.","321 \u2013 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0623\u0646 \u0623\u062d\u0631\u062c .","322 \u2013 \u0627\u0644\u0645\u0627\u0644 \u0648\u0627\u0644\u0639\u0645\u0644 \u064a\u062b\u064a\u0631\u0627\u0646 \u0627\u0644\u0642\u0644\u0642 \u0639\u0646\u062f\u064a.","323 \u2013 \u0645\u0631\u0631\u062a \u0628\u062e\u0628\u0631\u0627\u062a \u063a\u0627\u064a\u0629 \u0641\u064a \u0627\u0644\u063a\u0631\u0627\u0628\u0629 .","324 \u2013 \u0644\u0645 \u0623\u0642\u0639 \u0641\u064a \u062d\u0628 \u0623\u064a \u0634\u062e\u0635.","325 \u2013 \u0625\u0646 \u0645\u0627 \u0642\u0627\u0645 \u0628\u0647 \u0628\u0639\u0636 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u064a \u0623\u062b\u0627\u0631 \u0641\u064a \u0627\u0644\u0641\u0632\u0639 .","326 \u2013 \u062a\u0639\u062a\u0631\u064a\u0646\u064a \u0645\u0646 \u062d\u064a\u0646 \u0644\u0622\u062e\u0631 \u0646\u0648\u0628\u0627\u062a \u0645\u0646 \u0627\u0644\u0636\u062d\u0643 \u0648\u0627\u0644\u0628\u0643\u0627\u0621 \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u0633\u064a\u0637\u0631\u0629 \u0639\u0644\u064a\u0647\u0627 .","327 \u2013 \u0643\u0627\u0646 \u0623\u0628\u064a \u0623\u0648 \u0623\u0645\u064a \u064a\u0631\u063a\u0645\u0646\u064a \u0639\u0644\u0649 \u0627\u0644\u0637\u0627\u0639\u0629 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0646\u062a \u0623\u0639\u0644\u0645 \u0623\u0646 \u0627\u0644\u0623\u0645\u0631 \u0627\u0644\u0630\u064a \u0623\u0637\u064a\u0639\u0647 \u063a\u064a\u0631 \u0645\u0639\u0642\u0648\u0644.","328 \u2013 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0623\u0646 \u0623\u0631\u0643\u0632 \u0630\u0647\u0646\u064a \u0641\u064a \u0639\u0645\u0644 \u0623\u0648 \u0645\u0647\u0645\u0629 \u0645\u0627.","329 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0627 \u0623\u0641\u0642\u062f \u0642\u062f\u0631\u062a\u064a \u0639\u0644\u0649 \u0627\u0644\u0643\u0644\u0627\u0645 \u0623\u0648 \u064a\u062a\u063a\u064a\u0631 \u0635\u0648\u062a\u064a \u062d\u062a\u0649 \u0648\u0644\u0648 \u0644\u0645 \u0623\u0643\u0646 \u0645\u0635\u0627\u0628\u0627\u064b \u0628\u0627\u0644\u0628\u0631\u062f.","330 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0623\u0646 \u0623\u0635\u0628\u062a \u0628\u0627\u0644\u0634\u0644\u0644 \u0623\u0648 \u0623\u0635\u064a\u0628\u062a \u0639\u0636\u0644\u0627\u062a\u064a \u0628\u0623\u064a \u0636\u0639\u0641 \u063a\u064a\u0631 \u0639\u0627\u062f\u064a.","331 \u2013 \u0644\u0648 \u0644\u0645 \u064a\u0636\u0645\u0631 \u0644\u064a \u0627\u0644\u0646\u0627\u0633 \u0639\u062f\u0627\u0648\u0629 \u0644\u0643\u0646\u062a \u0623\u0643\u062b\u0631 \u0646\u062c\u0627\u062d\u0627\u064b \u0628\u0643\u062b\u064a\u0631 \u0645\u0645\u0627 \u0623\u0646\u0627 \u0639\u0644\u064a\u0647 \u0627\u0644\u0622\u0646.","332 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0627 \u064a\u062d\u062a\u0628\u0633 \u0635\u0648\u062a\u064a \u0623\u0648 \u064a\u062a\u063a\u064a\u0631 \u062d\u062a\u0649 \u0644\u0648 \u0644\u0645 \u0623\u0643\u0646 \u0645\u0635\u0627\u0628\u0627\u064b \u0628\u0627\u0644\u0628\u0631\u062f.","333 \u2013 \u064a\u0628\u062f\u0648 \u0623\u0646\u0647 \u0644\u0627 \u064a\u0648\u062c\u062f \u0645\u0646 \u064a\u0641\u0647\u0645\u0646\u064a.","334 \u2013 \u0623\u0634\u0645 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0631\u0648\u0627\u0626\u062d \u063a\u0631\u064a\u0628\u0629.","335 \u2013 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0631\u0643\u0632 \u0641\u0643\u0631\u064a \u0641\u064a \u0645\u0648\u0636\u0648\u0639 \u0648\u0627\u062d\u062f.","336 \u2013 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0623\u0646 \u064a\u0646\u0641\u0630 \u0635\u0628\u0631\u064a \u0645\u0639 \u0627\u0644\u0646\u0627\u0633.","337 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u0642\u0644\u0642 \u0639\u0644\u0649 \u0634\u0626 \u0623\u0648 \u0634\u062e\u0635 \u0645\u0627.","338 \u2013 \u0644\u0627 \u0634\u0643 \u0641\u064a \u0623\u0646 \u0646\u0635\u064a\u0628\u064a \u0645\u0646 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0627\u0644\u0645\u0633\u0628\u0628\u0629 \u0644\u0644\u0642\u0644\u0642 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u062d\u064a\u0627\u0629 \u0643\u0627\u0646 \u0643\u0628\u064a\u0631\u0627\u064b.","339 \u2013 \u0623\u062a\u0645\u0646\u0649 \u0627\u0644\u0645\u0648\u062a \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646.","340 \u2013 \u064a\u062a\u0647\u064a\u062c \u0634\u0639\u0648\u0631\u064a \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0644\u062f\u0631\u062c\u0629 \u0623\u0646\u0647 \u064a\u062a\u0639\u0630\u0631 \u0639\u0644\u064a \u0627\u0644\u0646\u0648\u0645.","341 \u2013 \u064a\u0635\u0628\u062d \u0633\u0645\u0639\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0631\u0647\u0641\u0627\u064b \u0644\u062f\u0631\u062c\u0629 \u062a\u0636\u0627\u064a\u0642\u0646\u064a.","342 \u2013 \u0623\u0646\u0633\u0649 \u0645\u0627 \u064a\u0642\u0627\u0644 \u0644\u064a \u0641\u064a \u0627\u0644\u062d\u0627\u0644.","343 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0623\u062a\u0648\u0642\u0641 \u0648\u0623\u0641\u0643\u0631 \u0642\u0628\u0644 \u0623\u0646 \u0623\u0639\u0645\u0644 \u062d\u062a\u0649 \u0641\u064a \u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u062a\u0627\u0641\u0647\u0629.","345 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0644\u064a\u0633\u062a \u062d\u0642\u064a\u0642\u0629 \u0648\u0627\u0642\u0639\u0629.","346 \u2013 \u0639\u0646\u062f\u064a \u0639\u0627\u062f\u0629 \u0639 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u063a\u064a\u0631 \u0627\u0644\u0647\u0627\u0645\u0629 \u0643\u0644\u0645\u0628\u0627\u062a \u0627\u0644\u0643\u0647\u0631\u0628\u0627\u0621 \u0641\u064a \u0627\u0644\u0637\u0631\u064a\u0642 \u0623\u0648 \u0645\u0627 \u0625\u0644\u0649 \u0630\u0644\u0643.","347 \u2013 \u0644\u064a\u0633 \u0644\u064a \u0623\u0639\u062f\u0627\u0621 \u064a\u0631\u064a\u062f\u0648\u0646 \u0636\u0631\u0631\u064a.","348 \u2013 \u0623\u0645\u064a\u0644 \u0625\u0644\u0649 \u0627\u0644\u062d\u0630\u0631 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u0627\u0644\u0630\u064a\u0646 \u064a\u0638\u0647\u0631\u0648\u0646 \u0635\u062f\u0627\u0642\u0629 \u0623\u0643\u062b\u0631 \u0645\u0645\u0627 \u062a\u0648\u0642\u0639\u062a.","349 \u2013 \u0639\u0646\u062f\u064a \u0623\u0641\u0643\u0627\u0631 \u063a\u0631\u064a\u0628\u0629 \u063a\u064a\u0631 \u0639\u0627\u062f\u064a\u0629.","350 \u2013 \u0623\u0633\u0645\u0639 \u0623\u0635\u0648\u0627\u062a\u0627\u064b \u063a\u0631\u064a\u0628\u0629 \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0628\u0645\u0641\u0631\u062f\u064a.","351 \u2013 \u0623\u0642\u0644\u0642 \u0648\u0623\u0636\u0637\u0631\u0628 \u0639\u0646\u062f\u0645\u0627 \u0623\u0636\u0637\u0631 \u0625\u0644\u0649 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0631\u062d\u0644\u0629 \u0635\u063a\u064a\u0631\u0629 \u0628\u0639\u064a\u062f\u0627\u064b \u0639\u0646 \u0627\u0644\u0645\u0646\u0632\u0644.","352 \u2013 \u062d\u062f\u062b \u0623\u0646 \u062e\u0641\u062a \u0645\u0646 \u0623\u0645\u0648\u0631 \u0623\u0648 \u0645\u0646 \u0623\u0634\u062e\u0627\u0635 \u0643\u0646\u062a \u0623\u0639\u0644\u0645 \u0623\u0646\u0647\u0645 \u0644\u0627 \u064a\u0633\u062a\u0637\u064a\u0639\u0648\u0646 \u0623\u0646 \u064a\u0636\u0631\u0648\u0646\u064a.","353 \u2013 \u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u062e\u0648\u0641 \u0645\u0646 \u0627\u0644\u062f\u062e\u0648\u0644 \u0628\u0645\u0641\u0631\u062f\u064a \u0641\u064a \u062d\u062c\u0631\u0629 \u0628\u0647\u0627 \u0623\u0646\u0627\u0633 \u064a\u062a\u062d\u062f\u062b\u0648\u0646.","354 \u2013 \u0623\u062e\u0627\u0641 \u0623\u0646 \u0623\u0633\u062a\u062e\u062f\u0645 \u0633\u0643\u064a\u0646\u0627\u064b \u0623\u0648 \u0623\u064a \u0634\u0626 \u062d\u0627\u062f \u0623\u0648 \u0645\u062f\u0628\u0628.","355 \u2013 \u0623\u062c\u062f \u0645\u062a\u0639\u0629 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0641\u064a \u0625\u064a\u0630\u0627\u0621 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u0623\u062d\u0628\u0647\u0645.","356 \u2013 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u062a\u0631\u0643\u064a\u0632 \u062a\u0641\u0643\u064a\u0631\u064a.","357 \u2013 \u062d\u062f\u062b \u0623\u0646 \u0627\u0645\u062a\u0646\u0639\u062a \u0639\u062f\u0629 \u0645\u0631\u0627\u062a \u0639\u0646 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0639\u0645\u0644 \u0645\u0627 \u0644\u0627\u0639\u062a\u0642\u0627\u062f\u064a \u0628\u0636\u0639\u0641 \u0642\u062f\u0631\u062a\u064a \u0639\u0644\u0649 \u0627\u0644\u0642\u064a\u0627\u0645 \u0628\u0647 .","358 \u2013 \u062a\u0637\u0631\u0623 \u0639\u0644\u0649 \u0641\u0643\u0631\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0641\u0643\u0631\u0629 \u0643\u0644\u0645\u0627\u062a \u0628\u0630\u064a\u0626\u0629 \u0623\u0648 \u0645\u062e\u062c\u0644\u0629 \u0644\u0627 \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u062a\u062e\u0644\u0635 \u0645\u0646\u0647\u0627.","359 \u2013 \u062a\u0633\u062a\u0648\u0644\u064a \u0639\u0644\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0641\u0643\u0631\u0629 \u062a\u0627\u0641\u0647\u0629 \u0648\u062a\u0638\u0644 \u062a\u0636\u0627\u064a\u0642\u0646\u064a \u0639\u062f\u0629 \u0623\u064a\u0627\u0645.","360 \u2013 \u064a\u062d\u062f\u062b \u0641\u064a \u0643\u0644 \u064a\u0648\u0645 \u062a\u0642\u0631\u064a\u0628\u0627\u064b \u0645\u0627 \u064a\u0633\u0628\u0628 \u0644\u064a \u0627\u0644\u0641\u0632\u0639.","361 \u2013 \u0623\u0645\u064a\u0644 \u0625\u0644\u0649 \u0623\u0646 \u0622\u062e\u0630 \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0645\u0623\u062e\u0630 \u0627\u0644\u062c\u062f.","362 \u2013 \u0625\u0646\u0646\u064a \u0623\u0643\u062b\u0631 \u062d\u0633\u0627\u0633\u064a\u0629 \u0645\u0646 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 ","363 \u2013 \u062d\u062f\u062b \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0623\u0633\u062a\u0645\u062a\u0639\u062a \u0628\u0627\u064a\u0630\u0627\u0621 \u0628\u0639\u0636 \u0623\u062d\u0628\u0627\u0626\u064a \u0644\u064a.","364 \u2013 \u064a\u0642\u0648\u0644 \u0627\u0644\u0646\u0627\u0633 \u0639\u0646\u064a \u0623\u0634\u064a\u0627\u0621 \u0645\u0647\u064a\u0646\u0629 \u0648\u0648\u0636\u064a\u0639\u0629.","365 \u2013 \u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u0627\u0631\u062a\u064a\u0627\u062d \u062f\u0627\u062e\u0644 \u0645\u0646\u0632\u0644\u064a.","366 \u2013 \u0623\u0634\u0639\u0631 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0628\u0627\u0644\u0648\u062d\u062f\u0629 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0646\u062a \u0645\u0639 \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","367 \u2013 \u0644\u0648 \u0623\u0639\u0637\u064a\u062a \u0627\u0644\u0641\u0631\u0635\u0629 \u0644\u0627\u0633\u062a\u0637\u0639\u062a \u0623\u0646 \u0623\u0642\u0648\u0645 \u0628\u0627\u0639\u0645\u0627\u0644 \u062c\u0644\u064a\u0644\u0629 \u0627\u0644\u0641\u0627\u0626\u062f\u0629 \u0644\u0644\u0639\u0627\u0644\u0645.","368 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0642\u0627\u0628\u0644\u062a \u0623\u0634\u062e\u0627\u0635\u0627\u064b \u0645\u0646 \u0627\u0644\u0645\u0641\u0631\u0648\u0636 \u0623\u0646\u0647\u0645 \u062e\u0628\u0631\u0627\u0621 \u0648\u0644\u0643\u0646\u0647\u0645 \u0644\u0645 \u064a\u0643\u0648\u0646\u0648\u0627\u064b \u0623\u062d\u0633\u0646 \u0645\u0646\u064a.","369 \u2013 \u0639\u0646\u062f \u0633\u0645\u0627\u0639\u064a \u0628\u0646\u062c\u0627\u062d \u0634\u062e\u0635 \u0623\u0639\u0631\u0641\u0647 \u0645\u0639\u0631\u0641\u0629 \u062c\u064a\u062f\u0629 \u0623\u0634\u0639\u0631 \u0643\u0645\u0627 \u0644\u0648 \u0643\u0627\u0646 \u0646\u062c\u0627\u062d\u0647 \u0641\u0634\u0644\u0627\u064b \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u064a.","370 \u2013 \u0644\u0648 \u0627\u0639\u0637\u064a\u062a \u0627\u0644\u0641\u0631\u0635\u0629 \u0644\u0623\u0635\u0628\u062d\u062a \u0632\u0639\u064a\u0645\u0627\u064b \u0646\u0627\u0641\u0639\u0627\u064b \u0644\u0644\u0646\u0627\u0633.","371 \u2013 \u0644\u0633\u062a \u0623\u0643\u062b\u0631 \u062d\u0633\u0627\u0633\u064a\u0629 \u0645\u0646 \u0627\u0644\u0645\u0639\u062a\u0627\u062f.","372 \u2013 \u064a\u062e\u062c\u0644\u0646\u064a \u0633\u0645\u0627\u0639 \u0627\u0644\u062d\u0643\u0627\u064a\u0627\u062a \u0627\u0644\u0642\u0628\u064a\u062d\u0629 .","373 \u2013 \u064a\u0637\u0644\u0628 \u0627\u0644\u0646\u0627\u0633 \u0639\u0627\u062f\u0629 \u0623\u0646 \u062a\u062d\u062a\u0631\u0645 \u062d\u0642\u0648\u0642\u0647\u0645 \u0628\u062f\u0631\u062c\u0629 \u062a\u0641\u0648\u0642 \u0627\u0633\u062a\u0639\u062f\u0627\u062f\u0647\u0645 \u0644\u0627\u062d\u062a\u0631\u0627\u0645 \u062d\u0642\u0648\u0642 \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","374 \u2013 \u064a\u0628\u062f\u0648 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0639\u0642\u0644\u064a \u064a\u0639\u0645\u0644 \u0628\u0628\u0637\u0621 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0627\u0644\u0645\u0639\u062a\u0627\u062f.","375 \u2013 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u062a\u0630\u0643\u0631 \u0627\u0644\u0642\u0635\u0635 \u0627\u0644\u0645\u0633\u0644\u064a\u0629 \u0644\u0623\u0631\u0648\u064a\u0647\u0627 \u0644\u0644\u0622\u062e\u0631\u064a\u0646.","376 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0642\u0648\u0645 \u0628\u0645\u0631\u0627\u0647\u0646\u0627\u062a \u0639\u0644\u0649 \u0645\u0628\u0627\u0644\u063a \u0635\u063a\u064a\u0631\u0629.","377 \u2013 \u0641\u064a \u0627\u0644\u062d\u0641\u0644\u0627\u062a \u0623\u0645\u064a\u0644 \u0625\u0644\u0649 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0628\u0645\u0641\u0631\u062f\u064a \u0645\u0639 \u0634\u062e\u0635 \u0648\u0627\u062d\u062f \u0641\u0642\u0637 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0623\u0646 \u0623\u0646\u0636\u0643 \u0625\u0644\u0649 \u0645\u062c\u0645\u0648\u0639\u0629 \u0643\u0628\u064a\u0631\u0629.","378 \u2013 \u0627\u0633\u062a\u0645\u062a\u0639 \u0628\u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u0627\u062a \u0644\u0645\u062c\u0631\u062f \u0631\u063a\u0628\u062a\u064a \u0641\u064a \u0627\u0644\u0648\u062c\u0648\u062f \u0645\u0639 \u0627\u0644\u0646\u0627\u0633.","379 \u2013 \u0627\u0633\u062a\u0645\u062a\u0639 \u0628\u0647\u064a\u0627\u062c \u0627\u0644\u062c\u0645\u0627\u0647\u064a\u0631.","380 \u2013 \u064a\u0628\u062f\u0648 \u0623\u0646 \u0642\u0644\u0642\u064a \u064a\u0632\u0648\u0644 \u0639\u0646\u062f\u0645\u0627 \u0627\u0648\u062c\u062f \u0645\u0639 \u062c\u0645\u0627\u0639\u0629 \u0645\u0646 \u0627\u0644\u0623\u0635\u062f\u0642\u0627\u0621 \u0627\u0644\u0645\u0631\u062d\u064a\u0646.","381 \u2013 \u0627\u0646\u0646\u064a \u0644\u0627 \u0627\u0634\u0627\u0631\u0643 \u0627\u0644\u062c\u0645\u0627\u0639\u0629 \u0627\u0644\u062a\u064a \u0627\u0646\u062a\u0645\u064a \u0627\u0644\u064a\u0647\u0627 \u0641\u064a \u0627\u0644\u0643\u062b\u064a\u0631 \u0645\u0646 \u0627\u0644\u0643\u0644\u0627\u0645 \u0623\u0648 \u0627\u0644\u062d\u062f\u064a\u062b \u0639\u0646 \u0627\u0644\u0646\u0627\u0633.","382 \u2013 \u0627\u062c\u062f \u0645\u0646 \u0627\u0644\u0635\u0639\u0628 \u0639\u0644\u0649\u0651 \u0623\u0646 \u0623\u062a\u062e\u0644\u0649 \u0648\u0644\u0648 \u0644\u0641\u062a\u0631\u0629 \u0642\u0635\u064a\u0631\u0629 \u0639\u0646 \u0639\u0645\u0644 \u0628\u062f\u0623\u062a\u0647.","383 \u2013 \u064a\u062e\u064a\u0628 \u0627\u0644\u0646\u0627\u0633 \u0639\u0627\u062f\u0629 \u0638\u0646\u064a \u0623\u0648 \u0631\u062c\u0627\u0626\u064a.","384 \u2013 \u0644\u0627 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0628\u062f\u0621 \u0627\u0644\u062a\u0628\u0648\u0644 \u0623\u0648 \u0641\u064a \u0636\u0628\u0637\u0647.","385 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0648\u062c\u062f\u062a \u0627\u0644\u0646\u0627\u0633 \u064a\u063a\u0627\u0631\u0648\u0646 \u0645\u0646 \u0623\u0641\u0643\u0627\u0631\u064a \u0627\u0644\u062c\u064a\u062f\u0629 \u0644\u0645\u062c\u0631\u062f \u0623\u0645\u0647\u0645 \u0644\u0645 \u064a\u0643\u0648\u0646\u0648\u0627 \u0645\u0646 \u0623\u0633\u0628\u0642 \u0645\u0646\u064a \u0641\u064a \u0627\u0644\u0648\u0635\u0648\u0644 \u0627\u0644\u064a\u0647\u0627.","386 \u2013 \u0623\u062a\u062d\u0627\u0634\u0649 \u0642\u062f\u0631 \u0625\u0645\u0643\u0627\u0646\u064a \u0623\u0646 \u0623\u0648\u062c\u062f \u0648\u0633\u0637 \u0627\u0644\u062c\u0645\u0627\u0647\u064a\u0631.","387 \u2013 \u0644\u0627 \u064a\u0635\u064a\u0631\u0646\u064a \u0623\u0646 \u0623\u0642\u0627\u0628\u0644 \u0627\u0644\u063a\u0631\u0628\u0627\u0621.","388 \u2013 \u0623/\u064a\u0644 \u0625\u0644\u0649 \u062a\u0631\u0643 \u0645\u0627 \u0623\u0631\u064a\u062f \u0623\u0646 \u0623\u0641\u0639\u0644\u0647 \u060c \u0625\u0630\u0627 \u0631\u0623\u0649 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u0623\u060c\u0647 \u0623\u0645\u0631 \u0644\u0627 \u064a\u0633\u062a\u062d\u0642 \u0627\u0644\u062a\u0646\u0641\u064a\u0630.","389 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u0631\u0643\u0628 \u0641\u064a \u0627\u0644\u0642\u0637\u0627\u0631\u0627\u062a \u0623\u0648 \u0641\u064a \u0627\u0644\u0633\u064a\u0627\u0631\u0627\u062a \u0627\u0644\u0639\u0627\u0645\u0629 \u0641\u0627\u0646\u0646\u064a \u0623\u062a\u062d\u062f\u062b \u0639\u0627\u062f\u0629 \u0625\u0644\u0649 \u0627\u0644\u0631\u0643\u0627\u0628.","390 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0631\u063a\u0628\u0629 \u0641\u064a \u0627\u0644\u062a\u0633\u0644\u064a\u0645 \u0628\u0633\u0631\u0639\u0629 \u0639\u0646\u062f\u0645\u0627 \u062a\u0633\u0648\u0621 \u0627\u0644\u0623\u0645\u0648\u0631.","391 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0630\u0647\u0627\u0628 \u0625\u0644\u0649 \u062d\u0641\u0644\u0627\u062a \u0627\u0644\u0631\u0642\u0635 .","392 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0639\u0631\u0641 \u0627\u0644\u0646\u0627\u0633 \u0628\u0645\u0648\u0642\u0641\u064a \u0645\u0646 \u0627\u0644\u0623\u0645\u0648\u0631.","393 \u2013 \u0645\u0631\u062a \u0639\u0644\u064a \u0641\u062a\u0631\u0627\u062a \u0643\u0646\u062a \u0623\u0634\u0639\u0631 \u0641\u064a\u0647\u0627 \u0628\u0646\u0634\u0627\u0637 \u0632\u0627\u0626\u062f \u0644\u062f\u0631\u062c\u0629 \u0623\u0646\u0646\u064a \u0644\u0645 \u0623\u0643\u0646 \u0623\u0634\u0639\u0631 \u0628\u062d\u0627\u062c\u0629 \u0625\u0644\u0649 \u0627\u0644\u0646\u0648\u0645 \u0644\u0645\u062f\u0629 \u0623\u064a\u0627\u0645.","394 \u2013 \u0644\u0627 \u0623\u0634\u0639\u0631 \u0628\u062d\u0631\u062c \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0641\u064a \u0645\u062c\u062a\u0645\u0639 \u0648\u064a\u0637\u0644\u0628 \u0625\u0644\u0649 \u0623\u0646 \u0623\u0628\u062f\u0623 \u0645\u0646\u0627\u0642\u0634\u0629 \u0623, \u0623\u0628\u062f\u064a \u0631\u0623\u064a\u064a \u0641\u064a \u0634\u0626 \u0623\u0639\u0631\u0641\u0647 \u0645\u0639\u0631\u0641\u0629 \u062c\u064a\u062f\u0629.","395 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0627\u062c\u062a\u0645\u0627\u0639\u0627\u062a \u0648\u0627\u0644\u062d\u0641\u0644\u0627\u062a.","396 \u2013 \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u0648\u0627\u062c\u0647 \u0623\u0632\u0645\u0629 \u0623\u0648 \u0635\u0639\u0648\u0628\u0629 .","397 \u2013 \u0645\u0631\u062a \u0628\u064a \u0641\u062a\u0631\u0629 \u0634\u0639\u0631\u062a \u0641\u064a\u0647\u0627 \u0628\u0623\u0646 \u0627\u0644\u0645\u0634\u0643\u0644\u0627\u062a \u0642\u062f \u0623\u062e\u0630\u062a \u062a\u062a\u0631\u0627\u0643\u0645 \u0628\u0634\u0643\u0644 \u062a\u0639\u0630\u0631 \u0645\u0639\u0647 \u062d\u0644\u0647\u0627.","398 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0642\u0644\u062a \u0644\u0646\u0641\u0633\u064a \u064a\u0627\u0644\u064a\u062a\u0646\u064a \u0639\u062f\u062a \u0637\u0641\u0644\u0627\u064b \u0645\u0631\u0629 \u0627\u062e\u0631\u0649.","399 \u2013 \u0623\u062a\u0630\u0643\u0631 \u0623\u0646\u0646\u064a \u0643\u0646\u062a \u0623\u062a\u0635\u0646\u0639 \u0627\u0644\u0645\u0631\u0636 \u0644\u0623\u0646\u0642\u0630 \u0646\u0641\u0633\u064a \u0645\u0646 \u0628\u0639\u0636 \u0627\u0644\u0645\u0622\u0632\u0642.","400 \u2013 \u0623\u062e\u0627\u0641 \u0645\u0646 \u0627\u0644\u0646\u0627\u0631.","401 \u2013 \u0644\u0627 \u0623\u062e\u0627\u0641 \u0645\u0646 \u0627\u0644\u0645\u0627\u0621.","402 -  \u0623\u062a\u0631\u064a\u062b \u0639\u0627\u062f\u0629 \u0642\u0628\u0644 \u0627\u0644\u0628\u062a \u0641\u064a \u0623\u064a \u0623\u0645\u0631 \u0645\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 .","403 \u2013 \u0639\u0638\u064a\u0645 \u0623\u0646 \u064a\u0639\u064a\u0634 \u0627\u0644\u0627\u0646\u0633\u0627\u0646 \u0641\u064a \u0647\u0630\u0647 \u0627\u0644\u0627\u064a\u0627\u0645 \u0627\u0644\u062a\u064a \u062a\u0643\u062b\u0631 \u0641\u064a\u0647\u0627 \u0627\u0644\u0623\u062d\u062f\u0627\u062b.","404 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u064a\u0633\u0626 \u0627\u0644\u0646\u0627\u0633 \u0641\u064a\u0647\u0645 \u0646\u0648\u0627\u064a\u0627\u064a \u0639\u0646\u062f\u0645\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0631\u0634\u062f\u0647\u0645 \u0623\u0648 \u0623\u0646 \u0623\u0633\u0627\u0639\u062f\u0647\u0645.","405 \u2013 \u0644\u0627 \u0623\u062c\u062f \u0635\u0639\u0648\u0628\u0629 \u0641\u064a \u0628\u0644\u0639 \u0627\u0644\u0637\u0639\u0627\u0645 .","406 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0645\u0627 \u0623\u062a\u062d\u0627\u0634\u0649 \u0634\u062e\u0635\u0627\u064b \u0644\u0623\u0646\u0646\u064a \u0623\u062e\u0634\u0649 \u0623\u0646 \u0623\u0641\u0639\u0644 \u0623\u0648 \u0623\u0642\u0648\u0644 \u0634\u064a\u0626\u0627\u064b \u0623\u0646\u062f\u0645 \u0639\u0644\u064a\u0647 \u0641\u064a\u0645\u0627 \u0628\u0639\u062f.","407 \u2013 \u0645\u0646 \u0639\u0627\u062f\u062a\u064a \u0623\u060c \u0623:\u0648\u0646 \u0647\u0627\u062f\u0626\u0627\u064b \u0648\u0644\u064a\u0633 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0627\u0633\u062a\u062b\u0627\u0631\u064a.","408 \u2013 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u060c \u0623\u062e\u0641\u064a \u0645\u0627 \u0623\u062d\u0633 \u0628\u0647 \u0625\u0644\u0649 \u062f\u0631\u062c\u0629 \u0623\u0646 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u0642\u062f \u064a\u062c\u0631\u062d \u0634\u0639\u0648\u0631\u064a \u062f\u0648\u0646 \u0623\u0646 \u064a\u0639\u0644\u0645 \u0630\u0644\u0643.","409 \u2013 \u0623\u062a\u0639\u0628 \u0646\u0641\u0633\u064a \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0633\u0628\u0628 \u062a\u062d\u0645\u0644\u064a \u0639\u0645\u0644\u0627\u064b \u0641\u0648\u0642 \u0637\u0627\u0642\u062a\u064a.","410 \u2013 \u0625\u0646\u0647 \u064a\u0633\u0631\u0646\u064a \u062d\u0642\u0627\u064b \u0623\u060c \u0623\u062a\u063a\u0644\u0628 \u0639\u0644\u0649 \u0646\u0635\u0627\u0628 \u0641\u064a \u0646\u0641\u0633 \u0627\u0644\u0634\u0626 \u0627\u0644\u0630\u064a \u062a\u062e\u0635\u0635 \u0641\u064a\u0647.","411 \u2013 \u0644\u0633\u062a \u0642\u0644\u0642\u0627\u064b \u0645\u0646 \u0627\u0644\u0646\u0627\u062d\u064a\u0629 \u0627\u0644\u062f\u064a\u0646\u064a\u0629.","412 \u2013 \u0644\u0627 \u0623\u062e\u0627\u0641 \u0645\u0646 \u0632\u064a\u0627\u0631\u0629 \u0627\u0644\u0637\u0628\u064a\u0628 \u0644\u0644\u0643\u0634\u0641 \u0639\u0644\u0649 \u0645\u0627 \u0627\u0631\u062a\u0643\u0628\u062a\u0647 \u0645\u0646 \u0622\u062b\u0627\u0645.","413 \u2013 \u0623\u0633\u062a\u062d\u0642 \u0623\u0646 \u0623\u0639\u0627\u0642\u0628 \u0639\u0642\u0627\u0628\u0627\u064b \u0634\u062f\u064a\u062f\u0627\u064b \u0639\u0644\u0649 \u0645\u0627 \u0627\u0631\u062a\u0643\u0628\u062a\u0647 \u0645\u0646 \u0622\u062b\u0627\u0645.","414 \u2013 \u062a\u0624\u062b\u0631 \u0641\u064a \u0627\u0644\u062e\u0628\u0631\u0627\u062a \u0627\u0644\u0645\u0624\u0644\u0645\u0629 \u0644\u062f\u0631\u062c\u0629 \u0623\u0646\u0646\u064a \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0627\u0646 \u0623\u0637\u0631\u062f\u0647\u0627 \u0645\u0646 \u0630\u0647\u0646\u064a.","415 \u2013 \u0644\u0627 \u0627\u062d\u0628 \u0627\u0646 \u0627\u0636\u0637\u0631 \u0644\u0644\u0625\u0633\u0631\u0627\u0639 \u0641\u064a \u0639\u0645\u0644\u064a .","416 \u2013 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0623\u0646 \u064a\u0644\u0627\u062d\u0638\u0646\u064a \u0634\u062e\u0635 \u0645\u0627 \u0623\u062b\u0646\u0627\u0621 \u0627\u0644\u0639\u0645\u0644 \u062d\u062a\u0649 \u0648\u0644\u0648 \u0643\u0646\u062a \u0623\u0639\u0631\u0641 \u0627\u0646\u0646\u064a \u0623\u0633\u062a\u0637\u064a\u0639 \u0627\u0646 \u0627\u0642\u0648\u0645 \u0628\u0647\u0630\u0627 \u0627\u0644\u0639\u0645\u0644 \u0639\u0644\u0649 \u0627\u0643\u0645\u0644 \u0648\u062c\u0647.","417 \u2013 \u0627\u062a\u0636\u0627\u064a\u0642 \u0639\u0646\u062f\u0645\u0627 \u064a\u062d\u0627\u0648\u0644 \u0627\u062d\u062f \u0623\u0646 \u064a\u062a\u062e\u0637\u064a \u062f\u0648\u0631\u064a \u0644\u062f\u0631\u062c\u0629 \u0627\u0646\u0646\u064a \u0644\u0627 \u0627\u062a\u0645\u0627\u0644\u0643 \u0625\u0644\u0627 \u0627\u0646 \u0627\u062d\u062f\u062b\u0647 \u0641\u064a \u0630\u0644\u0643.","418 \u2013 \u0627\u0639\u062a\u0642\u062f \u0641\u064a \u0628\u0639\u0636 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 \u0625\u0646\u0647 \u0644\u0627 \u0641\u0627\u0626\u062f\u0629 \u0645\u0646\u064a \u0639\u0644\u0649 \u0648\u062c\u0647 \u0627\u0644\u0625\u0637\u0644\u0627\u0642.","419 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0647\u0631\u0628\u062a \u0645\u0646 \u0627\u0644\u0645\u062f\u0631\u0633\u0629 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0637\u0641\u0644\u0627\u064b.","420 \u2013 \u0645\u0631\u062a \u0628\u064a \u062d\u0627\u0644\u0627\u062a \u062f\u064a\u0646\u064a\u0629 \u063a\u0631\u064a\u0628\u0629.","421 \u2013 \u0648\u0627\u062d\u062f \u0623\u0648 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u064a \u0639\u0635\u0628\u064a \u062c\u062f\u0627\u064b.","422 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u062d\u0631\u062c \u0628\u0633\u0628\u0628 \u0627\u0644\u0645\u0647\u0646\u0629 \u0627\u0644\u062a\u064a \u064a\u0634\u062a\u063a\u0644 \u0628\u0647\u0627 \u0648\u0627\u062d\u062f \u0627\u0648 \u0623\u0643\u062b\u0631 \u0645\u0646 \u0623\u0641\u0631\u0627\u062f \u0627\u0633\u0631\u062a\u064a.","423 \u2013 \u0625\u0646\u0646\u064a \u0645\u0646 \u0647\u0648\u0627\u0629 \u0635\u064a\u062f \u0627\u0644\u0633\u0645\u0643.","424 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u062c\u0648\u0639 \u0645\u0639\u0638\u0645 \u0627\u0644\u0648\u0642\u062a.","425 \u2013 \u0623\u062d\u0644\u0645 \u0643\u062b\u064a\u0631\u0627\u064b .","426 \u2013 \u0623\u0636\u0637\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0625\u0644\u0649 \u0627\u0646 \u0623\u0643\u0648\u0646 \u0641\u0638\u0627\u064b \u0645\u0639 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u063a\u064a\u0631 \u0627\u0644\u0645\u0624\u062f\u0628\u064a\u0646 \u0623\u0648 \u0627\u0644\u0630\u064a\u0646 \u064a\u0636\u0627\u064a\u0642\u0648\u0646 \u063a\u064a\u0631\u0647\u0645.","427 \u2013 \u0623\u0645\u064a\u0644 \u0625\u0644\u0649 \u0627\u0644\u0627\u0647\u062a\u0645\u0627\u0645 \u0628\u0639\u062f\u0629 \u0647\u0648\u0627\u064a\u0627\u062a \u0645\u062e\u062a\u0644\u0641\u0629 \u0641\u064a \u0627\u0644\u0648\u0642\u062a \u0627\u0644\u0648\u0627\u062d\u062f \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0623\u0646 \u0623\u062a\u0639\u0644\u0642 \u0628\u0648\u0627\u062d\u062f\u0629 \u0645\u0646\u0647\u0627 \u0641\u0642\u0637 \u0644\u0645\u062f\u0629 \u0637\u0648\u064a\u0644\u0629.","428 \u2013 \u0627\u062d\u0628 \u0623\u0646 \u0623\u0642\u0631\u0623 \u0627\u0644\u0645\u0642\u0627\u0644\u0627\u062a \u0627\u0644\u0627\u0641\u062a\u062a\u0627\u062d\u064a\u0629 \u0641\u064a \u0627\u0644\u0635\u062d\u0641.","429 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u062d\u0636\u0631 \u0627\u0644\u0645\u062d\u0627\u0636\u0631\u0627\u062a \u0627\u0644\u062a\u064a \u062a\u0639\u0627\u0644\u062c \u0645\u0633\u0627\u0626\u0644 \u062c\u062f\u064a\u0629.","430 \u2013 \u064a\u062c\u0630\u0628\u0646\u064a \u0623\u0641\u0631\u0627\u062f \u0627\u0644\u062c\u0646\u0633 \u0627\u0644\u0622\u062e\u0631.","431 \u2013 \u0627\u0646 \u0645\u0627 \u0623\u062a\u0648\u0642\u0639\u0647 \u0644\u0646\u0641\u0633\u064a \u0645\u0646 \u062d\u0638 \u0639\u0627\u062b\u0631 \u064a\u0642\u0644\u0642 \u0628\u0627\u0644\u064a \u0625\u0644\u0649 \u062d\u062f \u0643\u0628\u064a\u0631.","432 \u2013 \u0623\u0639\u062a\u0646\u0642 \u0628\u0634\u062f\u0629 \u0628\u0639\u0636 \u0627\u0644\u0622\u0631\u0627\u0621 \u0627\u0644\u0633\u064a\u0627\u0633\u064a\u0629 .","433 \u2013 \u0643\u0627\u0646 \u0644\u064a \u0641\u064a\u0645\u0627 \u0645\u0636\u0649 \u0631\u0641\u0627\u0642 \u0645\u0646 \u0635\u0646\u0639 \u0627\u0644\u062e\u064a\u0627\u0644.","434 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0634\u062a\u0631\u0643 \u0641\u064a \u0633\u0628\u0627\u0642 \u0627\u0644\u0633\u064a\u0627\u0631\u0627\u062a.","435 \u2013 \u0623\u0641\u0636\u0644 \u0623\u0646 \u0623\u0634\u062a\u063a\u0644 \u0645\u0639 \u0633\u064a\u062f\u0627\u062a.","436 \u2013 \u0625\u0646\u0646\u064a \u0645\u062a\u0623\u0643\u062f \u0645\u0646 \u0623\u0646 \u062f\u064a\u0646\u0627\u064b \u0648\u0627\u062d\u062f\u0627\u064b \u0641\u0642\u0637 \u0647\u0648 \u0627\u0644\u062f\u064a\u0646 \u0627\u0644\u0635\u062d\u064a\u062d.","437 \u2013 \u0644\u0627 \u0645\u0627\u0646\u0639 \u0645\u0646 \u0623\u0646 \u064a\u062d\u062a\u0627\u0644 \u0627\u0644\u0625\u0646\u0633\u0627\u0646 \u0627\u0644\u0642\u0627\u0646\u0648\u0646 \u0628\u0634\u0631\u0637 \u0623\u0644\u0627 \u064a\u062e\u0627\u0644\u0641\u0647 \u0641\u0639\u0644\u0627\u064b.","438 \u2013 \u0623\u0643\u0631\u0647 \u0628\u0639\u0636 \u0627\u0644\u0623\u0634\u062e\u0627\u0635 \u0643\u0631\u0627\u0647\u064a\u0629 \u0634\u062f\u064a\u062f\u0629 \u0644\u062f\u0631\u062c\u0629 \u0625\u0646\u0646\u064a \u0623\u0633\u0631 \u0641\u064a \u062f\u0627\u062e\u0644 \u0646\u0641\u0633\u064a \u0639\u0646\u062f\u0645\u0627 \u064a\u0642\u0639\u0648\u0646 \u0641\u064a \u0634\u0631 \u0623\u0639\u0645\u0627\u0644\u0647\u0645.","439 \u2013 \u0627\u0644\u0627\u0646\u062a\u0638\u0627\u0631 \u064a\u0642\u0644\u0642\u0646\u064a.","440 \u2013 \u0625\u0646 \u0648\u062c\u0648\u062f \u0634\u062e\u0635 \u0645\u0643\u062a\u0626\u0628 \u0623\u0648 \u0628\u0627\u0626\u0633 \u0643\u0641\u064a\u0644 \u0628\u0623\u0646 \u064a\u0641\u0633\u062f \u0639\u0644\u0649 \u0633\u0639\u0627\u062f\u062a\u064a \u0648\u0646\u0634\u0627\u0637\u064a.","441 \u2013 \u0623\u062d\u0628 \u0627\u0645\u0646 \u0627\u0644\u0646\u0633\u0627\u0621 \u0627\u0644\u0637\u0648\u064a\u0644\u0627\u062a.","442 \u2013 \u0645\u0631\u062a \u0628\u064a \u0641\u062a\u0631\u0627\u062a \u0643\u0646\u062a \u0644\u0627 \u0623\u0646\u0627\u0645 \u0623\u062b\u0646\u0627\u0621\u0647\u0627 \u0645\u0646 \u0627\u0644\u0642\u0644\u0642.","443 \u2013 \u0642\u062f \u0623\u062a\u0631\u0643 \u0639\u0645\u0644\u0627\u064b \u0623\u0631\u063a\u0628 \u0641\u064a \u0623\u062f\u0627\u0626\u0647 \u0627\u0630\u0627 \u0645\u0627 \u0631\u0623\u0649 \u0628\u0639\u0636 \u0627\u0644\u0646\u0627\u0633 \u0627\u0646\u0646\u064a \u0644\u0627 \u0623\u064c\u0642\u0648\u0645 \u0628\u0647 \u0639\u0644\u0649 \u0627\u0644\u0648\u062c\u0647 \u0627\u0644\u0635\u062d\u064a\u062d.","444 \u2013 \u0644\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0635\u062d\u062d \u0623\u062d\u062f\u0627\u064b \u064a\u0639\u0628\u0631 \u0639\u0646 \u0631\u0623\u064a \u062e\u0627\u0637\u0626.","445 \u2013 \u0643\u0646\u062a \u0623\u062d\u0628 \u0627\u0644\u0645\u0648\u0627\u0642\u0641 \u0627\u0644\u0645\u062b\u064a\u0631\u0629 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0635\u063a\u064a\u0631\u0627\u064b .","446 \u2013 \u0631\u062c\u0627\u0644 \u0627\u0644\u0628\u0648\u0644\u064a\u0633 \u0623\u0645\u0646\u0627\u0621 \u0639\u0627\u062f\u0629.","447 \u2013 \u0642\u062f \u0623\u062e\u0627\u0644\u0641 \u0627\u0644\u0645\u0628\u0627\u062f\u0626 \u0627\u0644\u0645\u0623\u0644\u0648\u0641\u0629 \u0644\u0643\u064a \u0623\u0641\u0648\u0632 \u0639\u0644\u0649 \u0634\u062e\u0635 \u064a\u0639\u0627\u0631\u0636\u0646\u064a.","448 \u2013 \u064a\u0636\u0627\u064a\u0642\u0646\u064a \u0627\u0644\u0627\u0634\u062e\u0627\u0635 \u0627\u0644\u0630\u064a\u0646 \u064a\u0631\u0627\u0642\u0628\u0648\u0646\u0646\u064a \u0641\u064a \u0627\u0644\u0634\u0627\u0631\u0639 \u0623\u0648 \u0627\u0644\u062a\u0631\u0627\u0645 \u0623\u0648 \u0641\u064a \u0627\u0644\u0645\u062d\u0644\u0627\u062a \u0627\u0644\u0639\u0627\u0645\u0629.","449 \u2013 \u0644\u0627 \u0623\u062d\u0628 \u0631\u0624\u064a\u0629 \u0627\u0644\u0646\u0633\u0627\u0621 \u0648\u0647\u0646 \u064a\u062f\u062e\u0646.","450 \u2013 \u0646\u0627\u062f\u0631\u0627\u064b \u0645\u0627 \u062a\u0639\u062a\u0631\u064a\u0646\u064a \u0646\u0648\u0628\u0627\u062a \u0645\u0646 \u0627\u0644\u0627\u0643\u062a\u0626\u0627\u0628 \u0623\u0648 \u0627\u0644\u064a\u0623\u0633.","451 \u2013 \u0639\u0646\u062f\u0645\u0627 \u064a\u0642\u0648\u0644 \u0634\u062e\u0635 \u0643\u0644\u0627\u0645\u0627\u064b \u062a\u0627\u0641\u0647\u0627\u064b \u0623\u0648 \u062e\u0637\u0627\u064b \u0639\u0646 \u0634\u0626 \u0623\u0639\u0631\u0641\u0647 \u0641\u0625\u0646\u0646\u064a \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0635\u062d\u062d\u0647.","452 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0646\u0643\u062a \u0639\u0644\u0649 \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","453 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0637\u0641\u0644\u0627\u064b \u0644\u0645 \u0623\u0643\u0646 \u0645\u0647\u062a\u0645\u0627\u064b \u0628\u0623\u0646 \u0623\u0643\u0648\u0646 \u0639\u0636\u0648\u0627\u064b \u0641\u064a \u062c\u0645\u0627\u0639\u0629 \u0623\u0648 \u0634\u0644\u0629.","454 \u2013 \u0641\u064a \u0625\u0645\u0643\u0627\u0646\u064a \u0623\u0646 \u0627\u0643\u0648\u0646 \u0633\u0639\u064a\u062f\u0627\u064b \u0644\u0648 \u0623\u0642\u0645\u062a \u0628\u0645\u0641\u0631\u062f\u064a \u0641\u064a \u0643\u0648\u062e \u0645\u0646\u0639\u0632\u0644.","455 \u2013 \u064a\u0642\u0627\u0644 \u0639\u0646\u064a \u0639\u0627\u062f\u0629 \u0627\u0646\u0646\u064a \u0633\u0631\u064a\u0639 \u0627\u0644\u063a\u0636\u0628.","456 \u2013 \u0644\u0627 \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u064a\u0639\u0627\u0642\u0628 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u064a\u062e\u0627\u0644\u0641 \u0642\u0627\u0646\u0648\u0646\u0627\u064b \u064a\u0639\u062a\u0642\u062f \u0627\u0646\u0647 \u063a\u064a\u0631 \u0645\u0639\u0642\u0648\u0644.","457 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u0627\u0644\u0623\u0646\u0633\u0627\u0646 \u0644\u0627 \u064a\u0646\u0628\u063a\u064a \u0623\u0646 \u064a\u0630\u0648\u0642 \u0627\u0644\u0645\u0633\u0643\u0631\u0627\u062a.","458 \u2013 \u0643\u0627\u0646 \u0648\u0644\u064a \u0623\u0645\u0631\u064a ( \u0623\u064a \u0623\u0628\u064a \u0623\u0648 \u0632\u0648\u062c \u0623\u0645\u064a ... \u0623\u0644\u062e ) \u0634\u062f\u064a\u062f\u0627\u064b \u0641\u064a \u0645\u0639\u0627\u0645\u0644\u062a\u0647 \u0644\u064a \u0623\u062b\u0646\u0627\u0621 \u0637\u0641\u0648\u0644\u062a\u064a.","459 \u2013 \u0639\u0646\u062f\u064a \u0639\u0627\u062f\u0627\u062a \u0633\u064a\u0626\u0629 \u0645\u0646 \u0627\u0644\u0642\u0648\u0629 \u0628\u062d\u064a\u062b \u064a\u0635\u0639\u0628 \u0627\u0644\u062a\u063a\u0644\u0628 \u0639\u0644\u064a\u0647\u0627.","460 \u2013 \u0623\u062a\u0646\u0627\u0648\u0644 \u0627\u0644\u0645\u0633\u0643\u0631\u0627\u062a \u0628\u0627\u0639\u062a\u062f\u0627\u0644 ( \u0623\u0648 \u0644\u0645 \u0623\u062a\u0646\u0627\u0648\u0644\u0647\u0627 \u0628\u062a\u0627\u062a\u0627\u064b )","461 \u2013 \u0623\u062a\u0645\u0646\u0649 \u0623\u0646 \u0623\u062a\u062e\u0644\u0635 \u0645\u0646 \u0627\u0644\u0642\u0644\u0642 \u0627\u0644\u0630\u064a \u064a\u0635\u064a\u0628\u0646\u064a \u062f\u0627\u0626\u0645\u0627\u064b \u0625\u0630\u0627 \u0642\u0644\u062a \u0643\u0644\u0627\u0645\u0627\u064b \u064a\u062c\u0631\u062d \u0634\u0639\u0648\u0631 \u0627\u0644\u0622\u062e\u0631\u064a\u0646.","462 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0623\u0646\u0646\u064a \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u062e\u0628\u0631 \u0623\u064a \u0634\u062e\u0635 \u0639\u0646 \u0643\u0644 \u0645\u0627 \u0641\u064a \u0646\u0641\u0633\u064a","463 \u2013 \u0643\u0646\u062a \u0645\u063a\u0631\u0645\u0627\u064b \u0628\u0644\u0639\u0628\u0629 ( \u0627\u0644\u062d\u062c\u0644\u0629 ) \u0623\u0648 ( \u0627\u0644\u0623\u0648\u0644\u0649 ) \u0623\u0648 (\u0627\u0644\u062a\u0631\u062c\u064a\u0644\u0629). ","464 \u2013 \u0644\u0645 \u0623\u0634\u0627\u0647\u062f ( \u0631\u0624\u064a\u0629 \u0625\u0644\u0647\u064a\u0629 ) \u0641\u064a \u062d\u064a\u0627\u062a\u064a .","465 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u063a\u064a\u0631\u062a \u0631\u0623\u064a\u064a \u0641\u064a \u0645\u0647\u0646\u062a\u064a.","466 \u2013 \u0644\u0627 \u0623\u062a\u0646\u0627\u0648\u0644 \u062f\u0648\u0627\u0621 \u0623\u0648 \u0645\u0646\u0648\u0645\u0627\u064b \u0625\u0644\u0627 \u0628\u0623\u0645\u0631 \u0627\u0644\u0637\u0628\u064a\u0628.","467 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u062d\u0641\u0638 \u0623\u0631\u0642\u0627\u0645\u0627\u064b \u0644\u0627 \u0623\u0647\u0645\u064a\u0629 \u0644\u0647\u0627 ( \u0645\u062b\u0644 \u0623\u0631\u0642\u0627\u0645 \u0627\u0644\u0633\u064a\u0627\u0631\u0627\u062a \u0645\u062b\u0644\u0627\u064b ).","468 \u2013 \u063a\u0627\u0644\u0628\u0627\u064e \u0645\u0627 \u0622\u0633\u0641 \u0639\u0644\u0649 \u0627\u0646\u0646\u064a \u063a\u0627\u0636\u0628 \u0648\u0645\u062a\u0630\u0645\u0631 \u0625\u0649 \u0647\u0630\u0627 \u0627\u0644\u062d\u062f .","469 \u2013 \u0627\u0644\u0628\u0631\u0627\u0642 \u064a\u062e\u064a\u0641\u0646\u064a.","470 \u2013 \u0627\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u062a\u062b\u064a\u0631 \u0627\u0634\u0645\u0626\u0632\u0627\u0632\u064a.","471 \u2013 \u0643\u0627\u0646\u062a \u062f\u0631\u062c\u0627\u062a \u0633\u0644\u0648\u0643\u064a \u0628\u0627\u0644\u0645\u062f\u0631\u0633\u0629 \u0631\u062f\u064a\u0626\u0629 \u0628\u0627\u0633\u062a\u0645\u0631\u0627\u0631.","472 \u2013 \u0623\u062d\u0628 \u0645\u0634\u0627\u0647\u062f\u0629 \u0627\u0644\u0646\u0627\u0631.","473 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0628\u0642\u0649 \u0627\u0644\u0646\u0627\u0633 \u0641\u064a \u0634\u0643 \u0645\u0646 \u0623\u0645\u0631 \u0645\u0627 \u0633\u0623\u0642\u0648\u0645 \u0628\u0647 \u0641\u064a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 .","474 \u2013 \u0645\u0631\u0627\u062a \u062a\u0628\u0648\u0644\u064a \u0644\u0627 \u062a\u0632\u064a\u062f \u0639\u0646 \u0645\u0631\u0627\u062a \u062a\u0628\u0648\u0644 \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633.","475 \u2013 \u0639\u0646\u062f\u0645\u0627 \u064a\u0636\u064a\u0642 \u0627\u0644\u062e\u0646\u0627\u0642 \u0639\u0644\u064a \u0645\u0627 \u0623\u0642\u0648\u0644 \u0627\u0644\u0635\u062f\u0642 \u0628\u0627\u0644\u0642\u062f\u0631 \u0627\u0644\u0630\u064a \u064a\u062d\u062a\u0645\u0644 \u0623\u0644\u0627 \u064a\u0636\u0631.","476 \u2013 \u0625\u0646\u0646\u064a \u0631\u0633\u0648\u0644 \u0627\u0644\u0639\u0646\u0627\u064a\u0629 \u0627\u0644\u0625\u0644\u0647\u064a\u0629.","477 \u2013 \u0625\u0630\u0627 \u0648\u0642\u0639\u062a \u0641\u064a \u0645\u0622\u0632\u0642 \u0645\u0639 \u0623\u062d\u062f \u0627\u0644\u0623\u0635\u062f\u0642\u0627\u0621 \u0627\u0644\u0645\u062a\u0633\u0627\u0648\u064a\u064a\u0646 \u0645\u0639\u064a \u0641\u064a \u0627\u0644\u0645\u0633\u0626\u0648\u0644\u064a\u0629 \u0641\u0625\u0646\u0646\u064a \u0623\u0641\u0636\u0644 \u0623\u0646 \u064a\u0642\u0639 \u0627\u0644\u0644\u0648\u0645 \u0643\u0644\u0647 \u0639\u0644\u064a \u060c \u0639\u0644\u0649 \u0623\u0646 \u0627\u0639\u062a\u0631\u0641 \u0639\u0644\u064a\u0647.","478 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0642\u0637 \u0623\u0646 \u0625\u0636\u0637\u0631\u0628\u062a \u0628\u0634\u0643\u0644 \u063a\u064a\u0631 \u0639\u0627\u062f\u0649 \u0628\u0633\u0628\u0628 \u0627\u0644\u0645\u0622\u0632\u0642 \u0627\u0644\u062a\u064a \u064a\u0643\u0648\u0646 \u0642\u062f \u0648\u0642\u0639 \u0641\u064a\u0647\u0627 \u0623\u064a \u0641\u0631\u062f \u0645\u0646 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u0649.","479 \u2013 \u0644\u064a\u0633 \u0647\u0646\u0627\u0643 \u0645\u0646 \u0645\u0639\u062c\u0632\u0627\u062a \u0641\u064a \u0646\u0638\u0631\u0649 \u0633\u0648\u0649 \u062a\u0644\u0643 \u0627\u0644\u062d\u064a\u0644 \u0627\u0644\u062a\u064a \u064a\u0642\u0648\u0645 \u0628\u0647\u0627 \u0628\u0639\u0636 \u0627\u0644\u0623\u0641\u0631\u0627\u062f.","480 \u2013 \u0623\u062e\u0627\u0641 \u0627\u0644\u0638\u0644\u0627\u0645 \u0641\u064a \u0645\u0639\u0638\u0645 \u0627\u0644\u0623\u062d\u064a\u0627\u0646 .","481 \u2013 \u0644\u064a\u0633 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0625\u063a\u0636\u0627\u0628\u0649 .","482 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0628\u062f\u062a \u0644\u064a \u062e\u0637\u0637\u0649 \u0645\u0645\u0644\u0648\u0621\u0629 \u0628\u0627\u0644\u0635\u0639\u0627\u0628 \u0644\u062f\u0631\u062c\u0629 \u0623\u0646 \u0623\u0636\u0637\u0631\u062a \u0625\u0644\u064a \u0627\u0644\u062a\u062e\u0644\u0649 \u0639\u0646\u0647\u0627 .","483 \u2013 \u0623\u0639\u062a\u0642\u062f \u0628\u0642\u064a\u0627\u0645 \u0627\u0644\u0623\u0646\u0628\u064a\u0627\u0621 \u0648\u0627\u0644\u0631\u0633\u0644 \u0628\u0627\u0644\u0645\u0639\u062c\u0632\u0627\u062a .","484 \u2013 \u0644\u062f\u0649 \u0628\u0639\u0636 \u0627\u0644\u0639\u064a\u0648\u0628 \u0627\u0644\u0643\u0628\u064a\u0631\u0629 \u0627\u0644\u062a\u064a \u0644\u0627 \u0623\u0631\u0649 \u0628\u062f\u0623 \u0645\u0646 \u0627\u0644\u062a\u0633\u0644\u064a\u0645 \u0628\u0647\u0627 \u0648\u0645\u062d\u0627\u0648\u0644\u0629 \u0636\u0628\u0637\u0647\u0627 \u0628\u062f\u0644\u0627\u064b \u0645\u0646 \u0645\u062d\u0627\u0648\u0644\u0629 \u0627\u0644\u062a\u062e\u0644\u0635 \u0645\u0646\u0647\u0627 .","485 \u2013 \u0639\u0646\u062f\u0645\u0627 \u064a\u0648\u062c\u062f \u0627\u0644\u0631\u062c\u0644 \u0645\u0639 \u0627\u0644\u0645\u0631\u0623\u0629 \u064a\u0641\u0643\u0631 \u0639\u0627\u062f\u0629 \u0641\u064a \u0623\u0645\u0648\u0631 \u062c\u0646\u0633\u064a\u0629 .","486 \u2013 \u0644\u0645 \u0623\u0644\u0627\u062d\u0638 \u0627\u0628\u062f\u0627\u064b \u0648\u062c\u0648\u062f \u0623\u064a \u062f\u0645 \u0641\u064a \u0628\u0648\u0644\u0649 .","487 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u0633\u064a\u0626 \u0641\u0647\u0645\u0649 \u0639\u0646\u062f\u0645\u0627 \u0643\u0646\u062a \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0645\u0646\u0639 \u0634\u062e\u0635\u0627\u064b \u0645\u0646 \u0625\u0631\u062a\u0643\u0627\u0628 \u062e\u0637\u0623 \u0645\u0627 \u0648\u0643\u0627\u0646 \u0647\u0630\u0627 \u064a\u0624\u0630\u0649 \u0634\u0639\u0648\u0631\u0649.","488 \u2013 \u0623\u0635\u0644\u064a \u0643\u062b\u064a\u0631\u0627\u064b .","489 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u0639\u0637\u0641 \u0646\u062d\u0648 \u0623\u0648\u0644\u0626\u0643 \u0627\u0644\u0630\u064a\u0646 \u064a\u063a\u0644\u0628 \u0639\u0644\u064a\u0647\u0645 \u0627\u0644\u0627\u0633\u062a\u063a\u0631\u0627\u0642 \u0641\u064a \u0623\u062d\u0632\u0627\u0646\u0647\u0645 \u0648\u0645\u062a\u0627\u0639\u0628\u0647\u0645 .","490 \u2013 \u0623\u0642\u0631\u0623 \u0627\u0644\u0642\u0631\u0622\u0646 (\u0623\u0648 \u0627\u0644\u0623\u0646\u062c\u064a\u0644 \u0623\u0648 \u0627\u0644\u062a\u0648\u0631\u0627\u0629) \u0639\u062f\u0629 \u0645\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0623\u0633\u0628\u0648\u0639 .","491 \u2013 \u0625\u0646\u0646\u064a \u0623\u0636\u064a\u0642 \u0628\u0647\u0624\u0644\u0627\u0621 \u0627\u0644\u0630\u064a\u0646 \u064a\u0639\u062a\u0642\u062f\u0648\u0646 \u0628\u0623\u0646 \u0647\u0646\u0627\u0643 \u062f\u064a\u0646 \u0648\u0627\u062d\u062f \u062d\u0642 \u0641\u0642\u0637 .","492 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u062e\u0648\u0641 \u0639\u0646\u062f\u0645\u0627 \u062a\u062e\u0637\u0631 \u0628\u0628\u0627\u0644\u0649 \u0641\u0643\u0631\u0629 \u0627\u0644\u0632\u0644\u0632\u0627\u0644 .","493 \u2013 \u0623\u0641\u0636\u0644 \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0630\u064a \u064a\u062a\u0637\u0644\u0628 \u0645\u0646\u0649 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0645\u0646\u062a\u0628\u0647\u0627\u064b \u0627\u0646\u062a\u0628\u0627\u0647\u0627\u064b \u0634\u062f\u064a\u062f\u0627\u064b \u0639\u0644\u064a \u0627\u0644\u0639\u0645\u0644 \u0627\u0644\u0630\u064a \u064a\u0633\u0645\u062d \u0644\u064a \u0628\u0627\u0644\u062a\u0647\u0627\u0648\u0646 .","494 \u2013 \u0623\u062e\u0627\u0641 \u0623\u0646 \u0623\u062c\u062f \u0646\u0641\u0633\u0649 \u0641\u064a \u0645\u0643\u0627\u0646 \u0635\u063a\u064a\u0631 \u0645\u063a\u0644\u0642 .","495 \u2013 \u0639\u0646\u062f\u0645\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u0635\u0644\u062d \u0634\u062e\u0635\u0627\u064b \u0645\u0627 \u0641\u0625\u0646\u0646\u0649 \u0644\u0627 \u0623\u062a\u0648\u0627\u0646\u0649 \u0639\u0646 \u0623\u0646 \u0627\u0635\u0627\u0631\u062d\u0647 \u0628\u0643\u0644 \u0634\u0626 .","496 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0642\u0637 \u0623\u0646 \u0631\u0623\u064a\u062a \u0627\u0644\u0623\u0634\u064a\u0627\u0621 \u0645\u0632\u062f\u0648\u062c\u0629 (\u0623\u064a \u0623\u0646 \u0634\u064a\u0626\u0627\u064b \u0644\u0645 \u064a\u0628\u062f \u0644\u064a \u0642\u0637 \u0639\u0644\u064a \u0623\u0646\u0647 \u0634\u064a\u0626\u0627\u0646 \u0628\u062f\u0648\u0646 \u0623\u0646 \u064a\u0643\u0648\u0646 \u0641\u064a \u0627\u0633\u062a\u0637\u0627\u0639\u062a\u0649 \u0625\u0639\u0627\u062f\u0629 \u0631\u0624\u064a\u062a\u0647 \u0643\u0634\u0626 \u0648\u0627\u062d\u062f \u0645\u0631\u0629 \u0623\u062e\u0631\u064a).","497 \u2013 \u062a\u0639\u062c\u0628\u0646\u0649 \u0642\u0635\u0635 \u0627\u0644\u0645\u063a\u0627\u0645\u0631\u0627\u062a .","498 \u2013 \u0627\u0644\u0635\u0631\u0627\u062d\u0629 \u0645\u062d\u0645\u0648\u062f\u0629 \u062f\u0627\u0626\u0645\u0627\u064b .","499 \u2013 \u064a\u062c\u0628 \u0623\u0646 \u0623\u0639\u062a\u0631\u0641 \u0628\u0625\u0646\u0647 \u0642\u062f \u0625\u0646\u062a\u0627\u0628\u0646\u0649 \u0642\u0644\u0642 \u063a\u064a\u0631 \u0639\u0627\u062f\u0649 \u0639\u0644\u064a \u0623\u0634\u064a\u0627\u0621 \u0644\u0645 \u062a\u0643\u0646 \u0641\u064a \u0627\u0644\u0648\u0627\u0642\u0639 \u0630\u0627\u062a \u0623\u0647\u0645\u064a\u0629 .","500 \u2013 \u0625\u0646\u0646\u0649 \u0645\u0633\u062a\u0639\u062f \u0644\u0623\u0646 \u0623\u062a\u0642\u0628\u0644 \u062a\u0645\u0627\u0645\u0627\u064b \u0623\u064a \u0641\u0643\u0631\u0629 \u062d\u0633\u0646\u0629 .","501 \u2013 \u0623\u0642\u0648\u0645 \u0639\u0627\u062f\u0629 \u0628\u062a\u0635\u0631\u064a\u0641 \u0623\u0645\u0648\u0631\u0649 \u0628\u0646\u0641\u0633\u0649 \u062f\u0648\u0646 \u0627\u0644\u0625\u0644\u062a\u062c\u0627\u0621 \u0625\u0644\u064a \u0623\u062d\u062f.","502 \u2013 \u062a\u0631\u0639\u0628\u0646\u0649 \u0627\u0644\u0639\u0648\u0627\u0635\u0641 .","503 \u2013 \u0644\u064a\u0633 \u0645\u0646 \u0639\u0627\u062f\u062a\u0649 \u0623\u0646 \u0623\u0639\u0628\u0631 \u0628\u0642\u0648\u0629 \u0639\u0646 \u062a\u0623\u064a\u064a\u062f\u0649 \u0623\u0648 \u0627\u0633\u062a\u0646\u0643\u0627\u0631\u0649 \u0644\u0623\u0639\u0645\u0627\u0644 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 .","504 \u2013 \u0644\u0627 \u0623\u062d\u0627\u0648\u0644 \u0623\u0646 \u0623\u062e\u0641\u0649 \u0639\u0646 \u0634\u062e\u0635 \u0645\u0627 \u0639\u062f\u0645 \u062a\u0642\u062f\u064a\u0631\u0649 \u0644\u0647 \u0623\u0648 \u0623\u0634\u0641\u0627\u0642\u0649 \u0639\u0644\u064a\u0647 .","505 \u2013 \u064a\u064a\u062c\u0628 \u0623\u0646 \u062a\u0636\u0631\u0628 \u0627\u0644\u0628\u063a\u0627\u0644 \u0623\u0648 \u062a\u0631\u0643\u0644 \u0639\u0646\u062f\u0645\u0627 \u062a\u062a\u0648\u0642\u0641 \u0639\u0646 \u062c\u0631 \u0627\u0644\u0639\u0631\u0628\u0627\u062a .","506 \u2013 \u0645\u0646 \u0627\u0644\u0633\u0647\u0644 \u0627\u0633\u062a\u062b\u0627\u0631\u062a\u0649 .","507 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u2013 \u0645\u0627 \u0639\u0645\u0644\u062a \u062a\u062d\u062a \u0631\u0626\u0627\u0633\u0629 \u0623\u0634\u062e\u0627\u0635 \u064a\u0647\u064a\u0626\u0648\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 \u0628\u062d\u064a\u062b \u0625\u0644\u064a\u0647\u0645 \u0627\u0644\u062e\u064a\u0631 \u0648\u064a\u0646\u0633\u0628 \u0625\u0644\u064a \u063a\u064a\u0631\u0647\u0645 \u0627\u0644\u0634\u0631 . ","508 \u2013 \u0623\u0639\u062a\u0642\u062f \u0623\u0646 \u062d\u0627\u0633\u0629 \u0627\u0644\u0634\u0645 \u0639\u0646\u062f\u0649 \u0644\u064a\u0633\u062a \u0623\u0642\u0644 \u0645\u0646\u0647\u0627 \u0639\u0646\u062f \u0645\u0639\u0638\u0645 \u0627\u0644\u0646\u0627\u0633 .","509 \u2013 \u0623\u062c\u062f \u0645\u0646 \u0627\u0644\u0635\u0639\u0648\u0628\u0629 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0646 \u0623\u062a\u0645\u0633\u0643 \u0628\u062d\u0642\u0648\u0642\u0649 \u0646\u0638\u0631\u0627\u064b \u0644\u062a\u062d\u0641\u0638\u0649 \u0627\u0644\u0634\u062f\u064a\u062f .","510 \u2013 \u0627\u0644\u0642\u0630\u0627\u0631\u0629 \u062a\u062e\u064a\u0641\u0646\u0649 \u0623\u0648 \u062a\u062b\u064a\u0631 \u0627\u0634\u0645\u0626\u0632\u0627\u0632\u0649 .","511 \u2013 \u0623\u0639\u064a\u0634 \u0641\u064a \u0623\u062d\u0644\u0627\u0645 \u0627\u0644\u064a\u0642\u0638\u0629 \u062d\u064a\u0627\u0629 \u0623\u0635\u0631\u062d \u0628\u0647\u0627 \u0644\u0644\u0622\u062e\u0631\u064a\u0646.","512 \u2013 \u0623\u0643\u0631\u0647 \u0627\u0644\u0627\u0633\u062a\u062d\u0645\u0627\u0645 .","513 \u2013  \u0641\u064a \u0627\u0639\u062a\u0642\u0627\u062f\u0649 \u0623\u0646 \u0645\u0635\u0637\u0641\u0649 \u0643\u0627\u0645\u0644 \u0643\u0627\u0646 \u0623\u0639\u0638\u0645 \u0645\u0646 \u0639\u0631\u0627\u0628\u0649.","514 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0646\u0633\u0627\u0621 \u0627\u0644\u0645\u0633\u062a\u0631\u062c\u0644\u0627\u062a .","515 \u2013 \u062a\u062a\u0648\u0641\u0631 \u0641\u064a \u0645\u0646\u0632\u0644\u0646\u0627 \u0627\u0644\u0636\u0631\u0648\u0631\u064a\u0627\u062a \u0627\u0644\u0645\u0639\u062a\u0627\u062f\u0629 (\u0645\u062b\u0644 \u0627\u0644\u0637\u0639\u0627\u0645 \u0627\u0644\u0643\u0627\u0641\u0649 \u0648\u0627\u0644\u0645\u0644\u0628\u0633 .. \u0625\u0644\u062e).","516 \u2013 \u0628\u0639\u0636 \u0623\u0641\u0631\u0627\u062f \u0639\u0627\u0626\u0644\u062a\u0649 \u0633\u0631\u064a\u0639\u0648 \u0627\u0644\u063a\u0636\u0628 .","517 \u2013 \u0644\u0627 \u0627\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0623\u062a\u0642\u0646 \u0623\u0649 \u0639\u0645\u0644 .","518 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0634\u0639\u0631\u062a \u0628\u0627\u0644\u0625\u062b\u0645 \u0628\u0633\u0628\u0628 \u062a\u0638\u0627\u0647\u0631\u0649 \u0628\u0627\u0644\u0623\u0633\u0641 \u0639\u0644\u064a \u0623\u0634\u064a\u0627\u0621 \u0628\u062f\u0631\u062c\u0629 \u0645\u0645\u0627 \u0623\u062d\u0633 \u0628\u0647 \u0641\u064a \u0627\u0644\u0648\u0627\u0642\u0639 .","519 \u2013 \u0647\u0646\u0627\u0643 \u0628\u0639\u0636 \u0627\u0644\u062e\u0644\u0644 \u0641\u064a \u0623\u0639\u0636\u0627\u0626\u0649 \u0627\u0644\u062a\u0646\u0627\u0633\u0644\u064a\u0629 .","520 \u2013 \u0645\u0646 \u0639\u0627\u062f\u062a\u0649 \u0623\u0646 \u0623\u062f\u0627\u0641\u0639 \u0628\u0642\u0648\u0629 \u0639\u0646 \u0622\u0631\u0627\u0626\u0649 .","521 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u0637\u0644\u0628 \u0627\u0644\u0646\u0635\u064a\u062d\u0629 \u0645\u0646 \u0627\u0644\u0622\u062e\u0631\u064a\u0646 .","522 \u2013 \u0644\u0627 \u0623\u062e\u0627\u0641 \u0645\u0646 \u0627\u0644\u0639\u0646\u0643\u0628\u0648\u062a .","523 \u2013 \u0644\u0627 \u064a\u062d\u0645\u0631 \u0648\u062c\u0647\u0649 \u0645\u0646 \u0627\u0644\u062e\u062c\u0644 .","524 \u2013 \u0644\u0627 \u0623\u062e\u0634\u0649 \u0623\u0646 \u062a\u0646\u062a\u0642\u0644 \u0625\u0644\u064a \u0627\u0644\u0623\u0645\u0631\u0627\u0636 \u0648\u0627\u0644\u062c\u0631\u0627\u062b\u064a\u0645 \u0645\u0646 \u0645\u0642\u0627\u0628\u0636 \u0627\u0644\u0623\u0628\u0648\u0627\u0628 .","525 \u2013 \u062a\u0636\u0637\u0631\u0628 \u0623\u0639\u0635\u0627\u0628\u0649 \u0639\u0646\u062f \u0631\u0624\u064a\u0629 \u062d\u064a\u0648\u0627\u0646\u0627\u062a \u0645\u0639\u064a\u0646\u0629 .","526 \u2013 \u0644\u0627 \u064a\u0628\u062f\u0648 \u0644\u064a \u0623\u064a \u0623\u0645\u0644 \u0641\u064a \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 .","527 \u2013 \u0627\u0644\u0639\u0644\u0627\u0642\u0627\u062a \u0637\u064a\u0628\u0629 \u0628\u064a\u0646 \u0623\u0641\u0631\u0627\u062f \u0623\u0633\u0631\u062a\u0649 \u0648\u0627\u0644\u0623\u064c\u0642\u0631\u0628\u064a\u0646 \u0645\u0646 \u0623\u0642\u0627\u0631\u0628\u0649 .","528 \u2013 \u0644\u0627 \u064a\u062d\u0645\u0631 \u0648\u062c\u0647\u0649 \u0628\u062f\u0631\u062c\u0629 \u063a\u064a\u0631 \u0639\u0627\u062f\u064a\u0629 (\u0623\u064a \u0623\u0643\u062b\u0631 \u0645\u0645\u0627 \u064a\u062d\u062f\u062b \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0644\u0623\u062e\u0631\u064a\u0646 .","529 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0644\u0628\u0633 \u0645\u0644\u0627\u0628\u0633 \u063a\u0627\u0644\u064a\u0629 .","530 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0623\u062e\u0634\u0649 \u0623\u0646 \u064a\u062d\u0645\u0631 \u0648\u062c\u0647\u0649 \u062e\u062c\u0644\u0627\u064b .","531 \u2013 \u064a\u0633\u062a\u0637\u064a\u0639 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 \u0628\u0633\u0647\u0648\u0644\u0629 \u0623\u0646 \u064a\u062d\u0648\u0644\u0648\u0646\u0649 \u0639\u0646 \u0631\u0623\u064a\u0649 \u062d\u062a\u064a \u0648\u0644\u0648 \u0643\u0646\u062a \u0642\u062f \u0635\u0645\u062a \u0628\u064a\u0646\u0649 \u0648\u0628\u064a\u0646 \u0646\u0641\u0633\u0649 \u0639\u0644\u064a \u0623\u0646 \u0647\u0630\u0627 \u0647\u0648 \u0631\u0623\u064a\u0649 \u0627\u0644\u0646\u0647\u0627\u0626\u064a \u0641\u064a \u0645\u0648\u0636\u0648\u0639 \u0645\u0627 .","532 \u2013 \u0623\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u0627\u062a\u062d\u0645\u0644 \u0627\u0644\u0622\u0644\u0627\u0645 \u0628\u0627\u0644\u062f\u0631\u062c\u0629 \u0627\u0644\u062a\u064a \u064a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u064a\u062a\u062d\u0645\u0644\u0647\u0627 \u0627\u0644\u0622\u062e\u0631\u0648\u0646 .","533 \u2013 \u0644\u0627 \u064a\u0636\u0627\u064a\u0642\u0646\u0649 \u062e\u0631\u0648\u062c \u063a\u0627\u0632\u0627\u062a \u0643\u062b\u064a\u0631\u0629 \u0645\u0646 \u0645\u0639\u062f\u062a\u0649 \u0639\u0646 \u0637\u0631\u064a\u0642 \u0627\u0644\u0641\u0645 (\u0644\u0627 \u064a\u0636\u0627\u064a\u0642\u0646\u0649 \u0623\u0646 \u0623\u062a\u062c\u0634\u0623 \u0643\u062b\u064a\u0631\u0627\u064b).","534 \u2013 \u0643\u062b\u064a\u0631\u0627\u064b \u0645\u0627 \u0643\u0646\u062a \u0622\u062e\u0631 \u0645\u0646 \u064a\u0643\u0641 \u0639\u0646 \u0645\u062d\u0627\u0648\u0644\u0629 \u0623\u062f\u0627\u0621 \u0639\u0645\u0644 \u0645\u0627.","535 \u2013 \u0623\u0634\u0639\u0631 \u0628\u062c\u0641\u0627\u0641 \u0641\u064a \u0641\u0645\u0649 \u0637\u0648\u0627\u0644 \u0627\u0644\u0648\u0642\u062a \u062a\u0642\u0631\u064a\u0628\u0627\u064b .","536 \u2013 \u064a\u063a\u0636\u0628\u0646\u0649 \u0623\u0646 \u064a\u0633\u062a\u0639\u062c\u0644\u0646\u0649 \u0627\u0644\u0646\u0627\u0633 .","537 \u2013 \u0623\u062d\u0628 \u0635\u064a\u062f \u0627\u0644\u062d\u064a\u0648\u0627\u0646\u0627\u062a \u0627\u0644\u0645\u0641\u062a\u0631\u0633\u0629 .","538 \u2013 \u0623\u062d\u0628 \u0639\u0645\u0644 \u0627\u0644\u062a\u0631\u0632\u0649 \u0623\u0648 \u062e\u064a\u0627\u0637 \u0627\u0644\u0645\u0644\u0627\u0628\u0633 .","539 \u2013 \u0644\u0627 \u0627\u062e\u0627\u0641 \u0627\u0644\u0641\u064a\u0631\u0627\u0646 .","540 \u2013 \u0644\u0645 \u064a\u0635\u0628 \u0648\u062c\u0647\u0649 \u0628\u0627\u0644\u0634\u0644\u0644 \u0642\u0637 .","541 \u2013 \u064a\u0628\u062f\u0648 \u0623\u0646 \u062c\u0644\u062f\u0649 \u062d\u0633\u0627\u0633 \u062c\u062f\u0627\u064b \u0644\u0644\u0645\u0633 .","542 \u2013 \u0644\u0645 \u064a\u062d\u062f\u062b \u0642\u0637 \u0623\u0646 \u0643\u0627\u0646 \u0628\u0631\u0627\u0632\u0649 \u0623\u0633\u0648\u062f \u0627\u0644\u0644\u0648\u0646 \u062c\u0627\u0641\u0627\u064b .","543 \u2013 \u064a\u0639\u062a\u0628\u0631\u0646\u0649 \u0634\u0639\u0648\u0631 \u0639\u062f\u0629 \u0645\u0631\u0627\u062a \u0641\u064a \u0627\u0644\u0623\u0633\u0628\u0648\u0639 \u0628\u0623\u0646 \u0634\u064a\u0626\u0627\u064b \u0645\u0631\u064a\u0639\u0627\u064b \u0639\u0644\u064a \u0648\u0634\u0643 \u0627\u0644\u062d\u062f\u0648\u062b .","544 \u2013 \u0623\u0634\u0639\u0631 \u0628\u0627\u0644\u062a\u0639\u0628 \u0645\u0639\u0638\u0645 \u0627\u0644\u0648\u0642\u062a .","545 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u064a\u0631\u0627\u0648\u062f\u0646\u0649 \u062d\u0644\u0645 \u0648\u0627\u062d\u062f \u0628\u0627\u0644\u0630\u0627\u062a \u0645\u0631\u0629 \u0628\u0639\u062f \u0623\u062e\u0631\u0649 .","546 \u2013 \u0623\u062d\u0628 \u0642\u0631\u0627\u0621\u0629 \u0627\u0644\u062a\u0627\u0631\u064a\u062e .","547 \u2013 \u0627\u0644\u0645\u0633\u062a\u0642\u0628\u0644 \u063a\u0627\u0645\u0636 \u0644\u062f\u0631\u062c\u0629 \u062a\u062c\u0639\u0644 \u0645\u0646 \u0627\u0644\u0639\u0628\u062b \u0623\u0646 \u064a\u0642\u0648\u0645 \u0634\u062e\u0635 \u0628\u0631\u0633\u0645 \u0623\u064a \u062e\u0637\u0629 \u0644\u0644\u0623\u0645\u0648\u0631 \u0627\u0644\u0647\u0627\u0645\u0629 .","548 \u2013 \u0644\u0627 \u0627\u0634\u0627\u0647\u062f \u0627\u0644\u0627\u0633\u062a\u0639\u0631\u0627\u0636\u0627\u062a \u0627\u0644\u062c\u0646\u0633\u064a\u0629 \u0623\u0628\u062f\u0627\u064b \u0645\u0627 \u062f\u0627\u0645 \u0641\u064a \u0627\u0633\u062a\u0637\u0627\u0639\u062a\u0649 \u0623\u0646 \u0627\u062a\u062c\u0646\u0628 \u0630\u0644\u0643 .","549 \u2013 \u0644\u0627 \u0627\u0647\u062a\u0645 \u0628\u0623\u064a \u0634\u0626 \u0631\u063a\u0645 \u0623\u0646 \u0627\u0644\u0623\u0645\u0648\u0631 \u062a\u0633\u064a\u0631 \u0628\u0627\u0644\u0646\u0633\u0628\u0629 \u0644\u0649 \u0639\u0644\u064a \u0645\u0627 \u064a\u0631\u0627\u0645 .","550 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0635\u0644\u062d \u0642\u0641\u0644 \u0627\u0644\u0628\u0627\u0628.","551 \u2013 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0623\u0643\u0648\u0646 \u0645\u062a\u0623\u0643\u062f\u0627\u064b \u0645\u0646 \u0623\u0646 \u063a\u064a\u0631\u0649 \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u064a\u0633\u062a\u0637\u064a\u0639 \u0623\u0646 \u064a\u0642\u0631\u0627\u064b \u0645\u0627 \u0641\u064a \u0630\u0647\u0646\u0649 .","552 \u2013 \u0623\u062d\u0628 \u0642\u0631\u0627\u0621\u0629 \u0645\u0648\u0636\u0648\u0639\u0627\u062a \u0627\u0644\u0639\u0644\u0648\u0645 .","553 \u2013 \u0623\u062e\u0627\u0641 \u0639\u0646\u062f\u0645\u0627 \u0623\u062c\u062f \u0646\u0641\u0633\u0649 \u0648\u062d\u064a\u062f\u0627\u064b \u0641\u064a \u0645\u0643\u0627\u0646 \u0645\u062a\u0633\u0639 \u063a\u064a\u0631 \u0645\u062d\u062f\u0648\u062f .","554 \u2013 \u0644\u0648 \u0643\u0646\u062a \u0641\u0646\u0627\u0646\u0627\u064b \u0644\u0623\u062d\u0628\u0628\u062a \u0623\u0646 \u0623\u0631\u0633\u0645 \u0627\u0644\u0623\u0637\u0641\u0627\u0644 .","555 \u2013 \u0623\u0634\u0639\u0631 \u0623\u062d\u064a\u0627\u0646\u0627\u064b \u0628\u0623\u0646\u0646\u0649 \u0639\u0644\u064a \u0648\u0634\u0643 \u0627\u0644\u0627\u0646\u0647\u064a\u0627\u0631 .","556 \u2013 \u0625\u0646\u0646\u0649 \u062c\u062f \u062d\u0631\u064a\u0635 \u0639\u0644\u064a \u0645\u0638\u0647\u0631\u0649 \u0641\u064a \u0627\u0644\u0645\u0644\u0628\u0633 .","557 \u2013 \u0623\u062d\u0628 \u0623\u0646 \u0623\u0643\u0648\u0646 \u0633\u0643\u0631\u062a\u064a\u0631\u0627\u064b \u062e\u0627\u0635\u0627\u064b .","558 \u2013 \u0623\u0639\u062a\u0642\u062f \u0627\u0646 \u0639\u062f\u062f\u0627\u064b \u0643\u0628\u064a\u0631\u0627\u064b \u0645\u0646 \u0627\u0644\u0646\u0627\u0633 \u064a\u0633\u0644\u0643 \u0633\u0644\u0648\u0643\u0627\u064b \u062c\u0646\u0633\u064a\u0627\u064b \u0645\u0634\u064a\u0646\u0627\u064b .","559 \u2013 \u063a\u0627\u0644\u0628\u0627\u064b \u0645\u0627 \u0627\u0646\u0632\u0639\u062c\u062a \u0641\u064a \u0645\u0646\u062a\u0635\u0641 \u0627\u0644\u0644\u064a\u0644 .","560 \u2013 \u0623\u062a\u0636\u0627\u064a\u0642 \u062d\u064a\u0646 \u0623\u0646\u0633\u0649 \u0623\u064a\u0646 \u0648\u0636\u0639\u062a \u0627\u0644\u0623\u0634\u064a\u0627\u0621 .","561 \u2013 \u0623\u062d\u0628 \u0631\u0643\u0648\u0628 \u0627\u0644\u062e\u064a\u0644 .","562 \u2013 \u0627\u0644\u0634\u062e\u0635 \u0627\u0644\u0630\u064a \u062a\u0639\u0644\u0642\u062a \u0628\u0647 \u0623\u0634\u062f \u0627\u0644\u062a\u0639\u0644\u0642 \u0648\u0627\u0644\u0630\u064a \u0623\u062d\u0628\u0628\u062a\u0647 \u0623\u0634\u062f \u0627\u0644\u062d\u0628 \u0643\u0627\u0646 \u0623\u0645\u0631\u0623\u0629 (\u0623\u0645 \u060c \u0639\u0645\u0629 \u060c \u0623\u0648 \u0623\u064a \u0623\u0645\u0631\u0623\u0629 \u0623\u062e\u0631\u0649).","563 \u2013 \u0623\u0641\u0636\u0644 \u0642\u0635\u0635 \u0627\u0644\u0645\u063a\u0627\u0645\u0631\u0627\u062a \u0639\u0644\u064a \u0642\u0635\u0635 \u0627\u0644\u062d\u0628 .","564 \u2013 \u0623\u062e\u0627\u0641 \u0645\u0646 \u0627\u0644\u0648\u062c\u0648\u062f \u0628\u0645\u0641\u0631\u062f\u0649 \u0641\u064a \u0627\u0644\u0638\u0644\u0627\u0645 .","565 \u2013 \u0623\u0634\u0639\u0631 \u0628\u062f\u0627\u0641\u0639 \u0625\u0644\u064a \u0627\u0644\u0642\u0641\u0632 \u0639\u0646\u062f\u0645\u0627 \u0623\u0643\u0648\u0646 \u0641\u064a \u0645\u0643\u0627\u0646 \u0639\u0627\u0644\u0650 .","566 \u2013 \u0623\u062d\u0628 \u0627\u0644\u0631\u0648\u0627\u064a\u0627\u062a \u0627\u0644\u0633\u064a\u0646\u0645\u0627\u0626\u064a\u0629 \u0627\u0644\u063a\u0631\u0627\u0645\u064a\u0629"],t.s)
